INSERT INTO Movie (Id, Name, Description, Background) VALUES(436969,'El Escuadrón Suicida','Un grupo de super villanos se encuentran encerrados en Belle Reve, una prisión de alta seguridad con la tasa de mortalidad más alta de Estados Unidos. Para salir de allí harán cualquier cosa, incluso unirse al grupo Task Force X, dedicado a llevar a cabo misiones suicidas bajo las órdenes de Amanda Waller. Fuertemente armados son enviados a la isla Corto Maltese, una jungla repleta de enemigos.','/jlGmlFOcfo8n5tURmhC7YVd4Iyy.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(451048,'Jungle Cruise','Principios del siglo XX. Frank (Dwayne Johnson) es el carismático capitán de una peculiar embarcación que recorre la selva amazónica. Allí, a pesar de los peligros que el río Amazonas les tiene preparados, Frank llevará en su barco a la científica Lily Houghton (Emily Blunt) y a su hermano McGregor Houghton (Jack Whitehall). Su misión será encontrar un árbol místico que podría tener poderes curativos. Claro que su objetivo no será fácil, y en su aventura se encontrarán con toda clase de dificultades, además de una expedición alemana que busca también este árbol con propiedades curativas. Esta comedia de acción y aventuras está basada en la atracción Jungle Cruise de los parques de ocio de Disney.','/7WJjFviFBffEJvkAms4uWwbcVUk.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(550988,'Free Guy','Un hombre descubre que en realidad es un personaje dentro de un videojuego. Guy (Ryan Reynolds) trabaja como cajero de un banco, es un tipo alegre y solitario al que nada la amarga el día. Incluso si le utilizan como rehén durante un atraco a su banco, él sigue sonriendo como si nada. Pero un día se da cuenta de que Free City no es exactamente la ciudad que él creía. Guy va a descubrir que en realidad es un personaje no jugable dentro de un brutal videojuego. Ahora que sabe que es un personaje de videojuego, Guy, acompañado por Molotov Girl (Jodie Comer), decidirá enfrentarse a todos los villanos que asolan la ciudad.','/j28p5VwI5ieZnNwfeuZ5Ve3mPsn.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(729720,'El último mercenario','Un misterioso ex agente del servicio secreto debe regresar urgentemente a Francia cuando su hijo separado es acusado falsamente por el gobierno de tráfico de armas y drogas, luego de un error cometido por un burócrata demasiado entusiasta y una operación de la mafia.','/rUoGZuscSG4fQP3I56ndadu2A8E.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(497698,'Viuda negra','Natasha Romanoff, alias Viuda Negra, se enfrenta a las partes más oscuras de su historia cuando surge una peligrosa conspiración con vínculos con su pasado. Perseguida por una fuerza que no se detendrá ante nada para acabar con ella, Natasha debe enfrentarse a su historia como espía y a las relaciones rotas que dejó a su paso mucho antes de convertirse en una Vengadora.','/dq18nCTTLpy9PmtzZI6Y2yAgdw5.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(581726,'Infinito','Evan McCauley tiene habilidades que nunca aprendió y recuerdos de lugares que nunca ha visitado. Automedicado y al borde de un colapso mental, un grupo secreto que se hace llamar "Infinitos" acuden a su rescate, revelando que sus recuerdos son reales.','/wjQXZTlFM3PVEUmKf1sUajjygqT.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(385128,'Fast & Furious 9','Dom Toretto lleva una vida tranquila con Letty y su hijo, el pequeño Brian, pero saben que el peligro siempre acecha. Esta vez, esa amenaza obligará a Dom a enfrentarse a los pecados de su pasado si quiere salvar a quienes más quiere. El equipo se vuelve a reunir para impedir un complot a escala mundial, liderado por uno de los asesinos más peligrosos y mejor conductor a los que se han enfrentado; un hombre que además es el hermano desaparecido de Dom, Jakob. Novena entrega de la famosa franquicia.','/xXHZeb1yhJvnSHPzZDqee0zfMb6.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(379686,'Space Jam: Nuevas leyendas','Secuela de la cinta original de 1996, Space Jam, protagonizada por Michael Jordan. En esta segunda parte, la super estrella de la NBA es LeBron James, quien queda atrapado junto a su hijo Dom en un extraño lugar, un espacio digital de una fuerza todopoderosa y malvada conocida como A.I. Para volver a casa y poner a salvo a su hijo, el jugador de baloncesto deberá unir fuerzas con Bugs Bunny, Lola Bunny y el resto de personajes de los Looney Tunes para enfrentarse en un partido de baloncesto a los campeones digitalizados por A.I.','/8s4h9friP6Ci3adRGahHARVd76E.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(727745,'Mi primer beso 3','Es el verano antes de que Elle se dirija a la universidad y tiene que tomar una decisión secreta. Elle ha sido aceptada en Harvard, donde se está matriculando su novio Noah, y también en Berkeley, donde se dirige su mejor amiga Lee. ¿Qué camino debería elegir?','/7BkkPaXnYo82T2pLSJP7GRyhD2S.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(508943,'Luca','Ambientada en un precioso pueblo costero de la Riviera italiana, narra la historia sobre el paso a la edad adulta de un chico que vive un verano inolvidable lleno de helados, pasta e infinitos paseos en scooter. Luca comparte estas aventuras con su nuevo mejor amigo, pero toda la diversión se ve amenazada por un secreto muy profundo: él es un monstruo marino de un mundo que yace bajo la superficie del agua.','/620hnMVLu6RSZW6a5rwO8gqpt0t.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(459151,'El Bebé Jefazo 2: Negocios de familia','Los hermanos Templeton se han convertido en adultos y se han alejado el uno del otro, pero un nuevo jefe bebé con un enfoque de vanguardia está a punto de unirlos nuevamente e inspirar un nuevo negocio familiar.','/gX5UrH1TLVVBwI7WxplW43BD6Z1.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(588228,'La guerra del mañana','Un día el mundo se paraliza cuando un grupo de viajeros en el tiempo se transporta desde el año 2051 para entregar un mensaje urgente: La humanidad está perdiendo la guerra mundial contra una especie alienígena letal. La única esperanza de supervivencia es que los soldados y los ciudadanos del presente sean transportados al futuro y se unan a la lucha. Entre los reclutados está el profesor de instituto y padre de familia Dan Forester (Chris Pratt) quien, decidido a salvar el mundo por su hija, se une a una brillante científica (Yvonne Strahovski) y a su padre (J.K. Simmons) en una búsqueda desesperada por reescribir el destino del planeta.','/yizL4cEKsVvl17Wc1mGEIrQtM2F.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(809968,'Bartkowiak','Tras el fallecimiento de su hermano en un accidente de coche, un joven luchador se hace cargo del club familiar y pronto se da cuenta de que esa muerte no fue accidental.','/6tPOZmNQ1tbzlhcMmyhYN1a1dEh.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(449406,'Vivo','Narra la vida de Vivo, un kinkajú («oso de la miel» de la selva tropical) dotado de un brillante talento para la música, que busca la forma de viajar desde La Habana hasta Miami para entregarle una canción al antiguo amor de su adorado dueño.','/2BftdeCkD7uf68KUxaKRBxtsmZZ.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(617502,'Jolt','Lindy es una mujer con un doloroso secreto: debido a un raro trastorno neurológico crónico, experimenta esporádicos impulsos de ira extremadamente violentos que solo pueden detenerse cuando se aplica una descarga a sí misma con un dispositivo especial de electrodos. Aunque es incapaz de encontrar el amor y de encajar en un mundo que teme su extraña condición, por fin logra confiar lo suficiente en un hombre como para enamorarse, solo para encontrarlo muerto al día siguiente. Desconsolada y enfurecida, se embarca en una misión de venganza para encontrar a su asesino, mientras es perseguida por la policía como principal sospechosa del crimen.','/wPjtacig0kIkVcTQmXoNt6jbMwo.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(602223,'La Purga: Infinita','Para los miembros de un movimiento clandestino, ya no es suficiente una noche anual de anarquía y asesinatos, así que deciden devolver a Estados Unidos el caos y las masacres sin fin, donde nadie volverá a estar a salvo... jamás. Adela y su esposo Juan viven en Texas, donde él trabaja como peón en un rancho para la adinerada familia Tucker. En la mañana después de la tradicional purga, una banda de asesinos enmascarados ataca violenta e ilegalmente a la familia Tucker. Tras este hecho, la familia texana se ve obligada a unirse con Juan y su esposa para enfrentar un país entero a punto de colapsar, que se hunde en un mar de caos y de sangre. Quinta y última entrega de la saga ´The Purge´.','/tehpKMsls621GT9WUQie2Ft6LmP.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(482373,'No Respires 2','El ciego se ha estado escondiendo durante años en una cabaña aislada y ha acogido y criado a una niña que perdió a sus padres en un incendio en una casa. Su tranquila existencia se hace añicos cuando un grupo de secuestradores aparece y se lleva a la niña, lo que obliga al Ciego a dejar su refugio seguro para rescatarla.','/hB8ypGAAq1YiyyTdCSQeFoXHPXW.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(283566,'Evangelion: 3.0+1.0','Cuarto y último volumen de La Reconstrucción de Evangelion. Misato y su grupo anti-NERV, Wille, llegan a una París roja por la nucleización. La tripulación de la nave Wunder aterriza en una torre de contención con solo 720 seg para reestablecer la ciudad. Cuando una horda de Evas NERV aparece, la mejorada Unidad Eva 8 debe interceptarlos. Mientras, Shinji, Asuka y Rei merodean por Japón.','/las0P4Dua54XrZ73VQmGUaH1z0U.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(337404,'Cruella','Ambientada en el Londres de los años 70, en plena revolución del punk rock, muestra a una joven estafadora llamada Estella, una chica inteligente y creativa, decidida a convertirse en una exitosa diseñadora de moda, que se asocia con un par de ladrones para sobrevivir en las calles de la capital británica. Pero cuando su talento para la moda llama la atención de la legendaria diseñadora, la Baronesa von Hellman, Estella cambia el rumbo de su vida hasta que una serie de acontecimientos y revelaciones que harán que Estella asuma su lado malvado y se convierta en la estridente, moderna y vengativa Cruella de Vil.','/6MKr3KgOLmzOP6MSuZERO41Lpkt.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(637649,'Despierta la furia','H (Jason Statham) es el misterioso tipo que acaba de incorporarse como guardia de seguridad en una compañía de blindados. Durante un intento de atraco a su camión, sorprende a sus compañeros mostrando habilidades de un soldado profesional, dejando al resto del equipo preguntándose quién es realmente y de dónde viene. Pronto se hará claro el verdadero motivo por el cual H está buscando un ajuste de cuentas.','/77tui163estZrQ78NBggqDB4n2C.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(685274,'Mobile Suit Gundam: Hathaway','32 años después del contraataque de Char, Hathaway Noa hereda una nueva generación.','/mI0Qo7VtgW5siCtQQqNPXIk0Ar6.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(672322,'Kenshin, el guerrero samurái: El principio','Kenshin Himura inicia la búsqueda de un misterioso traficante de armas llamado Enishi Yukishiro que controla el bajo mundo de China. Durante su misión se desvelará también el secreto de "Jujishou", un elemento íntimamente ligado al propio Himura.','/heMC3jAjQPNSlr1n9mZKUQ58EOE.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(525660,'Dynasty Warriors','Dynasty Warriors es una próxima película de acción y fantasía de Hong Kong basada en la franquicia japonesa de videojuegos del mismo título.','/iJ2HVOZT9Kjayrhy21pbGIJs9ey.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(520763,'Un lugar tranquilo 2','Tras los fatales acontecimientos sucedidos en la primera parte, la familia Abbot debe enfrentarse a los peligros del mundo exterior mientras luchan en silencio por sobrevivir. Forzados a aventurarse en lo desconocido, pronto se dan cuenta de que las criaturas que cazan orientadas por el sonido no son la única amenaza que acecha más allá del camino de arena. Secuela de la exitosa producción "Un lugar tranquilo" (A Quiet Place, 2018).','/z2UtGA1WggESspi6KOXeo66lvLx.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(423108,'Expediente Warren: Obligado por el demonio','Los investigadores paranormales Ed y Lorraine Warren se encuentran con lo que se convertiría en uno de los casos más sensacionales de sus archivos. La lucha por el alma de un niño los lleva más allá de todo lo que habían visto antes, para marcar la primera vez en la historia de los Estados Unidos que un sospechoso de asesinato reclamaría posesión demoníaca como defensa.','/qi6Edc1OPcyENecGtz8TF0DUr9e.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(846214,'Los Simpson: La buena, el malo y Loki','Loki es desterrado de Asgard una vez más y debe enfrentarse a sus oponentes más duros hasta el momento: Los Simpson y los héroes más poderosos de Springfield. El Dios del engaño se une a Bart Simpson en el evento crossover definitivo que rinde homenaje al universo cinematográfico de superhéroes y villanos de Marvel”','/zsH3iW60T1t2HBTtrSKzzxJ406J.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(635302,'Guardianes de la Noche: Tren infinito','Tanjiro y sus compañeros se unen al Pilar de las Llamas Kyojuro Rengoku para investigar una misteriosa serie de desapariciones que han ocurrido dentro del “Tren Infinito”. Poco saben que Enmu, uno de los miembros de las Doce Lunas Demoníacas, también está a bordo y les ha preparado una trampa.','/xPpXYnCWfjkt3zzE0dpCNME1pXF.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(460465,'Mortal Kombat','Un boxeador fracasado descubre un secreto familiar que lo lleva a un torneo místico llamado Mortal Kombat donde se encuentra con un grupo de guerreros que luchan hasta la muerte para salvar los reinos del malvado hechicero Shang Tsung.','/9yBVqNruk6Ykrwc32qrK2TIE5xw.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(503736,'Ejército de los muertos','Un grupo de mercenarios decide llevar a cabo el mayor atraco que jamás se haya realizado en la ciudad de Las Vegas, Nevada justo después de que se produzca una epidemia de muertos vivientes. Para ello tendrán que adentrarse en una zona de cuarentena, con los riesgos que ello conlleva.','/c0izdYdnTe4uMRifHgvTA85wPz0.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(675024,'El exorcismo de Carmen Farías','Carmen descubre que su abuela le ha dejado algo más que una casa como herencia.','/zm2kMjiz0u6qdn2XKbEbQkDiltN.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(730840,'Trollhunters: El despertar de los titanes','Los héroes de la serie Trollhunters se unen en una épica aventura para luchar contra la Orden de los Arcanos para determinar quién controla el poder de la magia que los une a todos.','/3OwaKVZf3A2NdnarqKbwzFEhKir.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(399566,'Godzilla vs. Kong','Godzilla y Kong, dos de las fuerzas más poderosas de un planeta habitado por todo tipo de aterradoras criaturas, se enfrentan en un espectacular combate que sacude los cimientos de la humanidad. Monarch (Kyle Chandler) se embarca en una misión de alto riesgo y pone rumbo hacia territorios inexplorados para descubrir los orígenes de estos dos titanes, en un último esfuerzo por tratar de salvar a dos bestias que parecen tener las horas contadas sobre la faz de la Tierra.','/inJjDhCjfhh3RtrJWBmmDqeuSYC.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(581644,'Ladrones de Elite','Después de ser reclutado por un grupo de ladrones poco convencionales, el renombrado criminal Richard Pace se ve envuelto en un elaborado atraco de oro que promete tener implicaciones de gran alcance en su vida y en la vida de muchos otros.','/6FzuNrApEc71aJ3CwwkpadbNled.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(522478,'Peter Rabbit 2: A la fuga','Bea, Thomas y los conejos han creado una familia improvisada, pero a pesar de sus mejores esfuerzos, Peter no parece sacudirse su traviesa reputación. Aventurándose más allá del ja´dín, peter se encuentra en un mundo que aprecia sus trastadas, pero cuando su familia lo arriesga todo por ir en su búsqueda, Peter deberá decidir qué tipo de conejo quiere ser.','/5HjzYTihkH7EvOWSE7KcsF6pBMM.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(791373,'La Liga de la Justicia de Zack Snyder','Con la determinación de asegurar que el sacrificio definitivo de Superman no fue en vano, Bruce Wayne une fuerzas con Diana Prince para reclutar a un equipo de metahumanos que protejan el mundo de una amenaza inminente de proporciones catastróficas. La tarea es más difícil de lo que Bruce imaginaba, ya que cada uno de los reclutas deberá enfrentarse a sus propios demonios para trascender aquello que los detenía, para unirse y formar de manera definitiva una liga de héroes sin precedentes. Ahora unidos, Batman, Wonder Woman, Aquaman, Cyborg y Flash deberán salvar al planeta de la amenaza de Steppenwolf, DeSaad y Darkseid, antes de que sea demasiado tarde.','/pcDc2WJAYGJTTvRSEIpRZwM3Ola.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(834404,'Teen Titans Go! See Space Jam','Los Jóvenes Titanes son visitados por los Nerdlucks, los villanos de Space Jam que intentaron capturar a Michael Jordan y los Looney Tunes. Asombrado de descubrir que sus compañeros Titanes nunca han visto Space Jam, Cyborg organiza una fiesta de observación exclusiva. Por supuesto, si los Titanes están viendo una película, no espere que el silencio sea dorado. Raven y Starfire brindan el comentario, Cyborg presenta los hechos divertidos, Beast Boy señala los tiros a tope y Robin, pero Robin no confía en sus nuevos amigos alienígenas. ¿Están los Nerdlucks aquí para asistir a una fiesta de vigilancia inocente, o tienen motivos más siniestros bajo la manga?','/x9p2syPxeK2OYCpz35fsg0EFjlG.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(615658,'Disomnia','Tras un suceso global repentino que acaba con todos los dispositivos electrónicos y con la capacidad para dormir de la humanidad, el caos comienza a consumir el mundo rápidamente. Solo Jill, un exsoldado con un pasado problemático, podría tener la clave de la cura en su propia hija. La cuestión es ¿podrá Jill entregar a su hija de manera segura y salvar al mundo antes de que ella misma pierda la cabeza?','/3RMbkXS4ocMmoJyAD3ZsWbm32Kx.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(763149,'Mudanza mortal','Una joven pareja acepta un trato y se muda a una casa de ensueño para salvar su matrimonio. Pronto, eventos inquietantes revelan el turbulento pasado de su nuevo hogar.','/twWLgj5hHFUI9PWE5vpet0OIxjA.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(726684,'El Mundo Miraculous: Shanghái, la leyenda de LadyDragon','Para unirse a Adrien en Shanghai, Marinette va a visitar a su tío Wang, quien celebra su cumpleaños. Pero tan pronto como llega a China, ¡le roban su bolso con Tikki!, lo que no le permite convertirse en una Ladybug en secreto! Privada y sola en la gran ciudad, Marinette acepta la ayuda de una joven muy ingeniosa, Fei. Las dos chicas se harán amigas y descubrirán la existencia de una nueva joya mágica, los Prodigios, que Hawk Moth, también presente en Shanghai, ha estado buscando durante mucho tiempo...','/rlNnwObbMu5G2FaOUlacnUIdIIA.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(649409,'Ni un paso en falso','Detroit, año 1954. Unos delincuentes de poca monta son contratados para robar lo que ellos creen que es un simple documento y será un trabajo fácil. Cuando su plan no sale como ellos esperaban, emprenden la búsqueda de quien los contrató y del propósito real para el que fueron contratados.','/ok7RdHhVngnwkvKj09tvtOvypG.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(813258,'Mascotas monstruosas: Un corto de Hotel Transilvania','En ‘Mascotas Monstruosas’, Pipis, el adorable cachorro de Drac, del tamaño de un monstruo, tiene más energía que nunca y ¡sólo quiere jugar a la pelota! Desafortunadamente, Drac está demasiado ocupado haciendo malabares con sus deberes en el hotel, por lo que está decidido a encontrar una mascota monstruo como compañero para su enorme y peludo amigo. Después de una serie de desajustes, el plan de Drac acaba mal cuando Pipis elige un compañero muy dudoso.','/c7dFSqZQYqNNJVpacpIGZe3gkLW.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(706972,'Operación Narco','Un hombre se convertirá en un criminal para salvar a su familia. Director: Shawn Welling Guionista: Derek H. Potts Estrellas: Tom Vera, Tom Sizemore, Lee Majors |','/vlM3uIetOwIXiBZeLhnzmI5ZoqJ.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(785539,'No se puede huir del amor','Para escapar de una ruptura amorosa, una cantante en apuros acepta trabajar en un centro vacacional. Todo parece paradisíaco, hasta que llegan huéspedes que no esperaba.','/TB88CYene7rzMs32FzFTLs0eU4.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(631843,'Tiempo','Thriller sobre una familia que, estando de vacaciones en un paraíso tropical, descubre que la recóndita playa elegida para relajarse unas horas está haciéndoles envejecer rápidamente... reduciendo toda su vida a un único día.','/iTgM25ftE7YtFgZwUZupVp8A61S.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(587996,'Bajocero','Invierno. Bajo cero. Noche cerrada. En mitad de una carretera despoblada, un furgón blindado es asaltado durante un traslado de presos. Alguien busca a uno de los presos y no parará hasta sacarlo. Su plan no tiene fisuras, no le importan las consecuencias, nada le va a detener. Pero Martín, el conductor del furgón, consigue atrincherarse dentro del cubículo blindado con los reclusos, convirtiéndose en su único obstáculo. Obligado a entenderse con sus enemigos naturales, Martín tratará de sobrevivir y cumplir con su deber en una larga noche de pesadilla que acabará haciendo que ponga en duda todos sus principios.','/6TPZSJ06OEXeelx1U1VIAt0j9Ry.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(760883,'Cielo rojo sangre','Una mujer con una misteriosa enfermedad sanguínea se ve obligada a entrar en acción cuando un grupo de terroristas secuestra un vuelo transatlántico nocturno. Con el fin de proteger a su hijo, tendrá que revelar su oscuro secreto y dar rienda suelta al monstruo interior que siempre ha intentado ocultar.','/e3JXvbbWNARPqMURImTALZBHVME.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(634528,'El protector','Un ranchero en la frontera de Arizona se convierte en el improbable defensor de un joven mexicano que huye desesperadamente de los asesinos del cartel que lo han perseguido hasta Estados Unidos.','/5Zv5KmgZzdIvXz2KC3n0MyecSNL.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(529106,'Igor Grom contra el Doctor Peste','El jefe de policía, Igor Grom, es conocido en San Petersburgo por su carácter incisivo y su actitud irreconciliable hacia los criminales. Pero todo cambia con la aparición de una persona con la máscara del Plague Doctor que asesina a gente que ha escapado de la justicia por dinero o estatus social.','/pVNXmfZvQKFdUKVYNJxZAiy69DC.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(567189,'Sin remordimientos','Un ex Navy SEAL convertido en agente de la CIA busca venganza después de que su novia es asesinada por un narcotraficante de Baltimore.','/fPGeS6jgdLovQAKunNHX8l0avCy.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(637693,'Spirit - Indomable','La vida de Lucky Prescott cambia para siempre cuando se muda de su casa en la gran ciudad a un pequeño pueblo fronterizo en el que entabla amistad con un caballo salvaje llamado Spirit.','/vqEjXzWdzPbV2DZ7bk29weDFiDl.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(495764,'Aves de presa (y la fantabulosa emancipación de Harley Quinn)','Después de separarse del Joker, Harley Quinn y otras tres heroínas (Canario Negro, Cazadora y Renée Montoya) unen sus fuerzas para salvar a una niña del malvado rey del crimen, Máscara Negra.','/jiqD14fg7UTZOT6qgvzTmfRYpWI.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(581387,'Alerta roja','El volcán en la montaña Baekdu hace erupción repentinamente, causando varios terremotos tanto en Corea del Norte como en el Sur. El caos reina en la península de Corea cuando se predicen más erupciones. Para prevenir un desastre mayor, Jeon Yoo-kyung (Jeon Hye-jin) planea una operación basada en la teoría del profesor Kang Bong-rae (Ma Dong-seok), quien ha estudiado la montaña Baekdu y sus posibles erupciones. Jo In-chang (Ha Jung-woo) es el capitán del equipo de fuerzas especiales y es asignado a la operación que mantiene el destino de ambas Coreas en la balanza. Él contacta a Lee Joon-pyeong (Lee Byung-hun), un espía norcoreano para realizar la operación conjuntamente. Mientras, su esposa embarazada, Choi Ji-young (Bae Suzy), está sola en Seúl intentando sobrevivir en medio del desastre.','/h9DIlghaiTxbQbt1FIwKNbQvEL.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(464052,'Wonder Woman 1984','En 1984, en plena guerra fría, Diana Prince, conocida como Wonder Woman se enfrenta al empresario Maxwell Lord y a su antigua amiga Barbara Minerva / Cheetah, una villana que posee fuerza y agilidad sobrehumanas.','/srYya1ZlI97Au4jUYAktDe3avyA.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(527774,'Raya y el último dragón','Raya, una niña de gran espíritu aventurero,  se embarca en la búsqueda del último dragón del mundo con el objetivo de devolver el equilibrio a Kumandra, un lejano y recóndito territorio habitado por una civilización milenaria.','/hJuDvwzS0SPlsE6MNFOpznQltDZ.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(615457,'Nadie','Hutch Mansell, un padre de familia que aguanta con resignación y sin defenderse los golpes de la vida. Un don nadie.  Una noche, cuando dos ladrones entran en su casa, Hutch decide no actuar y no trata de defenderse ni al él mismo ni a su familia, convencido de que solo así evitará una escalada de violencia. Tras el ataque, su hija adolescente Blake no oculta su decepción, y su esposa Becca se aleja todavía más.','/uWeffFhprUohUL5GO3YfQqdsVrI.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(736074,'Batman: El Largo Halloween, Parte 2','Mientras el joven justiciero de Gotham City, Batman, lucha por perseguir a un brutal asesino en serie, el fiscal de distrito Harvey Dent queda atrapado en una disputa que involucra a la familia criminal de los Falcones.','/j14Z0pP7tpuHZlVBSuUL7tq2SGb.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(632357,'Ruega por nosotros','Se centra en un periodista caído en desgracia que descubre una serie de aparentes milagros acaecidos en un pequeño pueblo de Nueva Inglaterra, aplicándolos para devolver su carrera al estrellato. Lo que desconoce es que estos milagros esconden una cara mucho más oscura de lo que él cree.','/jw6ASGRT2gi8EjCImpGtbiJ9NQ9.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(586047,'Seobok','Ki Hun es un ex agente de la agencia de inteligencia. Seo Bok es el primer clon humano y posee el secreto para la vida eterna. Ki Hun se involucra en situaciones peligrosas debido a varias fuerzas que quieren tomar posesión de Seo Bok.','/yC4DRg5aGgNpkHpUDpLtBqzownS.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(817451,'Especies en Peligro de Extincion','Jack Halsey lleva a su esposa, a sus hijos adultos y a un amigo a unas vacaciones de ensueño en Kenia. Pero cuando se aventuran solos a un parque salvaje, su furgoneta de safari es volcada por un rinoceronte enojado, dejándolos heridos y desesperados. Luego, cuando dos de ellos van en busca de rescate, un encuentro sangriento y cruel con un leopardo y un clan de hienas incita a una lucha desesperada por la supervivencia.','/A0xW7GgeFQoQmPOn7HcHkBQ5nlb.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(529203,'Los Croods: Una nueva era','Después de salir de su cueva, los Croods se encuentran con su mayor amenaza desde que se fueron: otra familia llamada Betterman, quienes afirman y demuestran ser mejores y evolucionados. Grug empieza a sospechar de los padres de Betterman, Phil y Hope, ya que planean en secreto separar a su hija Eep con su amado novio Guy para asegurarse de que su hija Dawn tenga un compañero amoroso e inteligente que la proteja.','/fmIp40ev4VGquK2bMo52PQgaV2d.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(335983,'Venom','Eddie Brock (Tom Hardy) es un consolidado periodista y astuto reportero que está investigando una empresa llamada Fundación Vida. Esta fundación, dirigida por el eminente científico Carlton Drake (Riz Ahmed), está ejecutando secretamente experimentos ilegales en seres humanos y realizando pruebas que involucran formas de vida extraterrestres y amorfas conocidas como simbiontes. Durante una visita furtiva a la central, el periodista quedará infectado por un simbionte. Comenzará entonces a experimentar cambios en su cuerpo que no entiende, y escuchará una voz interior, la del simbionte Venom, que le dirá lo que tiene que hacer. Cuando Brock adquiera los poderes del simbionte que le usa como huésped, Venom tomará posesión de su cuerpo, convirtiéndole en un despiadado y peligroso súpervillano.','/VuukZLgaCrho2Ar8Scl9HtV3yD.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(580489,'Venom: Habrá Matanza','Secuela de la película "Venom", el villano principal de la película será Carnage','/AhFRV5YxJamUZ4oZdxv6PI0ythi.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(585083,'Hotel Transilvania: Transformanía','Drac y la pandilla vuelven, como nunca los habías visto antes en Hotel Transilvania: Transformanía. Volveremos a encontrarnos con nuestros monstruos favoritos en una aventura completamente nueva en la que Drac se enfrentará a una de las situaciones más aterradoras vividas hasta el momento. Cuando el misterioso invento de Van Helsing, el "Rayo Monstrificador", se vuelve totalmente fuera de control, Drac y sus monstruosos amigos se transforman en humanos, ¡y Johnny se convierte en un monstruo!','/7QabKu8tizoqy8qCZJXljdSpP4A.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(809314,'El silencio de los espías','Sigue a Nicholas Shaw, un agente especial retirado que se convierte en parte de una élite invisible que se encarga de los peores villanos por todo el mundo.','/jWMWZ2ttg8B8YtVzG04UfhlcL67.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(591273,'La calle del terror - Parte 1: 1994','En 1994, un grupo de adolescentes descubre que los terribles sucesos que han asolado su ciudad durante generaciones están conectados y que pueden ser los próximos objetivos.','/5C8bfwglg91uZhc2fbfpSjNGamV.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(743439,'La patrulla al rescate','¡Prepárate para volver a Barkingburg con los cachorros en esta nueva película para televisión! Cuando el intrigante DUQUE de Flappington roba una poderosa gema de levitación del castillo real, ¡la Patrulla Canina debe acudir al rescate antes de que la ciudad se pierda para siempre! Luego, únete a la Patrulla Canina en más aventuras de alto vuelo en las que salvarán a un piloto de acrobacias, a uno de los gatitos del alcalde Humdinger e incluso a Skye cuando se rompa el ala al volar hacia la montaña de Jake.','/vwpxy4kmQyW5aBJ3uxhQM6koU6H.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(792657,'Safer at Home','Tras dos años de pandemia, un grupo de amigos organiza una salvaje fiesta online. Después de tomar éxtasis, las cosas salen terriblemente mal y la seguridad de sus hogares se vuelve más aterradora que el caos de fuera.','/7OKgyh8tuwXZJE9qfXvfvk8fp1l.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(458576,'Monster Hunter','Tras nuestro mundo hay otro: un mundo de monstruos peligrosos y poderosos que gobiernan sus dominios con una ferocidad mortal. Cuando la teniente Artemis y sus leales soldados son transportados de nuestro mundo al nuevo mundo, la imperturbable teniente recibe el golpe de su vida. En su desesperada batalla por sobrevivir contra enormes enemigos con poderes increíbles y ataques imparables y repugnantes, Artemis se unirá a un hombre misterioso que ha encontrado la forma de defenderse.','/z8TvnEVRenMSTemxYZwLGqFofgF.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(587807,'Tom y Jerry','Tom el gato y Jerry el ratón son expulsados de su casa y se trasladan a un elegante hotel de Nueva York, donde una empleada descuidada llamada Kayla perderá su trabajo si no puede desalojar a Jerry antes de una boda de clase alta en el hotel. ¿Su solución? Contratar a Tom para deshacerse del molesto ratón.','/9ns9463dwOeo1CK1JU2wirL5Yi1.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(568620,'Snake Eyes: El origen','G.I. JOE: Snake Eyes es protagonizada por Henry Golding. Snake Eyes es un solitario y tenaz guerrero que se une a al antiguo clan japonés de los Arashikage luego de salvarle la vida al heredero del clan. Al llegar a Japón, los Arashikage le enseñan a Snake Eyes los caminos del guerrero ninja y le dan algo que siempre quiso tener: un hogar. Pero, al revelarse los secretos sobre su pasado, pondrán a prueba el honor y la lealtad de Snake Eyes, incluso si eso significa perder la confianza de los más cercanos a él.','/2OFg5p9yarI5zZsUWKCRgBgPctj.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(755812,'Miraculous World: Las aventuras de Ladybug en Nueva York','Ladybug al lado de sus amigos, son enviados a la universidad de Nueva York con una finalidad, celebrar la Semana de la Amistad Franco-Americana, pero no cuentan con que se toparán con superhéroes estadounidenses que les cambiarán la estadía.','/aMFl4wOPhJ7NVua6SgU9zIJvFSx.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(522444,'Abismo','La película sigue a una pareja amante de la aventura, que convence a sus amigos para explorar un sistema de cuevas en un alejado bosque del norte de Australia. Con una tormenta acercándose, se precipitan a la boca de la cueva, la cual comienza a inundarse, lo que implica que se verán amenazados por una manada de hambrientos cocodrilos...','/fRrpOILyXuWaWLmqF7kXeMVwITQ.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(607259,'Ser padre','Un viudo convertido en papá lidia con las dudas, los miedos, el dolor y los pañales sucios mientras trata de criar a su hija solo. Inspirada en una historia real.','/miOnymJ0dN2psWBB8Vleo3fUyrc.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(550205,'El dragón de los deseos','Din es un adolescente que ansía volver a ver a su mejor amiga de la infancia. Un dragón que concede deseos le mostrará la magia de las posibilidades.','/4kIRrW1AlHP5Idne8CPHeQt8nR5.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(159211,'The Haunting of Helena','Tras su divorcio, Sophia decide trasladarse a Latina, al sur de Italia, junto con la pequeña Helena. La nueva casa está situada en un edificio austero de la era fascista, y oculta un misterioso armario de oscuros secretos. Después de la pérdida del primer diente de leche de Helena, empieza la pesadilla. Helena se ha obsesionado con el hada de los dientes y su madre asiste impotente a los acontecimientos que cada vez van a peor.','/uEWCi9fc89m9qS5SNshlvxkSsLJ.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(591275,'La calle del terror - Parte 3: 1666','En 1666, Deena descubre la verdad sobre Sarah Fier. De nuevo en 1994, los amigos luchan por sus vidas... y por el futuro de Shadyside.','/6viJBbovWxJYavdjPy7UPTLvaOS.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(384018,'Fast & Furious: Hobbs & Shaw','Desde que Hobbs, agente del Servicio de Seguridad Diplomática de Estados Unidos, y el británico Shaw, proscrito sin ley, se enfrentaron por primera vez, solo han intercambiado bofetadas y malas palabras. Pero cuando las despiadadas acciones de Brixton, un anarquista cibergenéticamente mejorado, amenazan el futuro de la humanidad, ambos se unen para derrotarlo.','/qAhedRxRYWZAgZ8O8pHIl6QHdD7.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(300669,'No respires','Unos jóvenes ladrones creen haber encontrado la oportunidad de cometer el robo perfecto. Su objetivo será un ciego solitario, poseedor de millones de dólares ocultos. Pero tan pronto como entran en su casa serán conscientes de su error, pues se encontrarán atrapados y luchando por sobrevivir contra un psicópata con sus propios y temibles secretos.','/hvXWVpKvFWAqiGyTYloudgLXKMY.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(475557,'Joker','Arthur Fleck es un hombre ignorado por la sociedad, cuya motivación en la vida es hacer reír. Pero una serie de trágicos acontecimientos le llevarán a ver el mundo de otra forma. Película basada en Joker, el popular personaje de DC Comics y archivillano de Batman, pero que en este film toma un cariz más realista y oscuro.','/n6bUvigpRFqSwmPp1m2YADdbRBc.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(687149,'Tóxico','En medio de una pandemia de insomnio que cobra lentamente dimensiones catastróficas, Laura y Augusto huyen de la ciudad en su motorhome para alejarse del caos. A medida que avanzan por la ruta, el mundo se vuelve un lugar cada vez más extraño y peligroso. Finalmente Laura revela una noticia que lo cambia todo. El camino se va despoblando, el silencio crece, cada vez resulta más difícil diferenciar la realidad del ensueño.','/pU15NMZueYMpcnJmBSB63a8uIMV.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(592350,'My Hero Academia: el despertar de los héroes','Un nuevo villano, llamado Nine, está buscando a Tomura Shigaraki. Para ello, decide atacar la isla de Nabutō. Segunda película de la serie anime "My Hero Academia".','/9guoVF7zayiiUq5ulKQpt375VIy.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(698320,'El Sombrerero Loco','Un profesor excéntrico lleva a cuatro de sus estudiantes a la mansión del "Sombrerero Loco", una leyenda urbana enloquecida por el envenenamiento por mercurio y el dolor. Dice que no hay nada de qué preocuparse ahora: los extraños y tambaleantes "cuidadores" que rondan la casa son simplemente sirvientes que han caído en la endogamia, y el Sombrerero mismo ha estado muerto durante años. Pero a medida que los estudiantes comienzan a desaparecer uno por uno, los que quedan comienzan a preguntarse si el experimento del profesor es verdaderamente científico ... y si el Sombrerero no solo sucumbió a su locura, sino que decidió difundirla ...','/syjh4WJARo5gwjyUYxOPOElWGWh.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(808023,'El virtuoso','Un asesino profesional debe localizar y matar a su último objetivo para satisfacer una deuda pendiente con su mentor. Pero la única información que se le ha dado es la hora y el lugar donde encontrar a su presa: las 5 de la tarde en un restaurante rústico en la ciudad decadente. Sin nombre, sin descripción, nada. Cuando llega al lugar, hay varios objetivos posibles, incluido el sheriff del condado. Poniendo en peligro su vida, el asesino se embarca en una cacería humana para encontrar al objetivo y cumplir su misión. Pero el peligro aumenta cuando los encuentros eróticos con una mujer lugareña amenazan con descarrilar su tarea.','/efrdAWS63s8TTWdrI2uNdIhn1dj.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(845422,'Fondeados','Dos hermanos sin dirección se drogan y lanzan una nueva y audaz aplicación de justicia social que recauda millones. Ahora solo tienen que crear la aplicación.','/80sOjpOe7M7sYjvYlhdnQTdxCl7.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(675445,'La patrulla canina: La película','','/swcF9sPlruc6s4gAHuWfbYicbqG.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(763240,'Sugar Daddy','Cuando un músico en apuros no puede pagar el alquiler, se registra en un sitio web donde los hombres mayores ricos pagan para salir con mujeres más jóvenes. Su nueva empresa para hacer dinero la envía a un oscuro agujero de conejo que la obliga a crecer rápido, dando forma a su música y a cómo ve el mundo.','/eC20CGV95aosLg9DynQIHE3QOc6.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(508442,'Soul','¿Alguna vez te has preguntado de dónde provienen tu pasión, tus sueños y tus intereses? ¿Qué es lo que te hace ser... tú? Viaja desde las calles de Nueva York a los reinos cósmicos para descubrir las respuestas a las preguntas más importantes de la vida.','/kf456ZqeC45XTvo6W9pW5clYKfQ.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(573164,'Un Rescate de Huevitos','Toto y Di son los padres de dos hermosos huevos: Uly y Max.','/5CfndBOq4T6mN6n87lcb86cfVeo.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(578701,'Aquellos que desean mi muerte','Un adolescente testigo de un asesinato es perseguido por dos asesinos gemelos a través de las tierras salvajes de Montana. Aunque cuenta con un experto de la supervivencia para evitar que los secuaces le den caza, un incendio cercano pronto amenaza con robar la vida de todos los implicados.','/ouOojiypBE6CD1aqcHPVq7cJf2R.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(604822,'Vanguard','Vanguard, una compañía de guardaespaldas, es la última esperanza de supervivencia para un contable que es perseguido por la organización de mercenarios más peligrosa del planeta.','/fX8e94MEWSuTJExndVYxKsmA4Hw.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(823855,'Yo soy todas ellas','Una implacable inspectora encuentra afinidades con un asesino que mata a los criminales que dirigen una poderosa red de tráfico de menores.','/gPKcJzrbgs1670fOeKN1xQH9mNa.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(726429,'Xtremo','Dos años después del asesinato de su hijo y de su padre, un sicario retirado pone en marcha un minucioso plan de venganza contra el asesino: su propio hermano.','/gGSm6ZmWtGazs2H1m0gOp7cx1ZZ.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(20982,'Naruto Shippuden 1: La Muerte de Naruto','Demonios que una vez destruyeron el mundo han sido revividos por alguien, de la unica manera de controlar a los demonios es sellandolos y la persona que lo puede hacer es shrine maiden Shion del Pais de los demonios quien tiene dos poderes, uno para sellar los demonios y el otro es predecir la muerte de los Humanos. La mision de Naruto es cuidar de Shion pero ella predice la muerte de Naruto. La unica forma de evitar la muerte, Naruto debe alejarce de Shion pero esto la dejaria indefensa, y el demonio el cual quiere matar a Shion conseguiria su objetivo lo cual terminaria siendo la destrucción del mundo, Naruto decide enfrentar la profecia de muerte al mantenerse al lado de Shion cumpliendo su misión.','/y3XMIea7mwTzxt3NFFXi5YJKeFJ.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(633954,'El manual de la familia perfecta','Una pareja en Quebec se enfrenta a las dificultades y las expectativas de criar niños en una sociedad obsesionada con el éxito y la presencia en las redes sociales.','/oZK07PoV0MAG8ts7n95foyRfU3l.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(591274,'La calle del terror - Parte 2: 1978','En 1978, Camp Nightwing está dividido en campistas que vinieron del pueblo oprimido de Shadyside y consejeros que vinieron del próspero pueblo de Sunnyvale. Cuando los horrores del pasado de ambos pueblos cogen fuerza, estos dos grupos deberán unirse para resolver un misterio terrorífico.','/7jpj6ek9dftr3IXm7Pnq2pkhir3.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(804435,'Una noche de venganza','Victoria es una madre joven que intenta dejar atrás su oscuro pasado como mensajero de drogas ruso, pero el policía retirado Damon obliga a Victoria a cumplir sus órdenes al mantener a su hija como rehén. Ahora, Victoria debe usar armas, agallas y una motocicleta para acabar con una serie de gánsteres violentos, o tal vez nunca vuelva a ver a su hijo.','/mYM8x2Atv4MaLulaV0KVJWI1Djv.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(739542,'Estados Unidos: La Película','George Washington debe reunir a un grupo de luchadores revolucionarios para combatir al tiránico Rey James.','/kkXMDMRGtuO9cewtFjWNREC74nf.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(768334,'La clásica historia de terror','Unos viajeros quedan atrapados en un bosque del sur de Italia, donde deben luchar desesperadamente para salir con vida de allí.','/xEopUXG3LwBpBav8xT2YxKQhb22.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(641501,'Cómo me convertí en superhéroe','París 2020. Mientras los superhéroes se han asimilado a la sociedad parisina, descubren una nueva droga que les otorga superpoderes personales a meros mortales. Los tenientes Moreau y Schaltzmann están investigando el caso con el apoyo de dos ex superhéroes, Montecarlo y Calista. Harán lo que sea necesario para desmantelar el tráfico. Pero el pasado de Moreau resurge y la investigación se vuelve más complicada.','/kDQdFs5XL6G8TuXvd0NnJfQ59GP.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(583083,'Mi primer beso 2','Elle debe tomar decisiones sobre la universidad, afrontar su relación a distancia con Noah, su cambiada amistad con Lee y lo que siente por un compañero de clase.','/wO5QSWZPBT71gMLvrRex0bVc0V9.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(811367,'22 contra la Tierra','22 desafía las reglas de El Gran Origen y se niega a ir a la Tierra. Para conseguirlo recluta a una pandilla de cinco almas nuevas en su intento de rebelión. Sin embargo, los resultados de las actividades de su séquito son totalmente inesperados y paradójicamente, la trama subversiva de 22 acabará en una revelación sorprendente sobre el significado de la vida.','/szY15QJKhed0nhUz1NONTz1vez5.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(454983,'Mi primer beso','Elle nunca imaginó que el primer beso daría para tanto. Pero, a pesar de que ha conseguido salir con el chico más guapo del instituto, está a punto de perder a su mejor amigo de toda la vida.','/itiz2OBK4ns6XT0ufXtusojmMt9.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(676845,'Juega Conmigo','Sofía, una joven insegura, comienza a trabajar en una casa cuidando a dos hermanos de carácter problemático, que le harán su estancia sumamente difícil. Sin embargo, durante una noche en que los padres están ausentes, los niños serán acosados por una entidad demoníaca y Sofía tendrá que tomar parte en un terrorífico juego para intentar salvarlos.','/jST0q4EMty2kYyggxxwvsjpHPOs.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(613504,'After: En mil pedazos','Ha pasado el tiempo, y Hardin todavía no se sabe si es realmente el chico profundo y reflexivo del que Tessa se enamoró, o ha sido un extraño todo este tiempo. Ella quiere alejarse, pero no es tan fácil. Tessa se ha centrado en sus estudios y comienza a trabajar como becaria en Vance Publishing. Allí conoce a Trevor, un nuevo y atractivo compañero de trabajo que es exactamente el tipo de persona con la que debería estar. Pero Hardin sabe que cometió un error, posiblemente el más grande de su vida y quiere corregir sus errores y vencer a sus demonios.','/6hgItrYQEG33y0I7yP2SRl2ei4w.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(338762,'Bloodshot','Ray Garrison, también conocido como Bloodshot, es resucitado por la compañía Rising Spirit Technologies a través del uso de nanotecnología. Mientras lucha por recuperar la memoria, Ray trata de volver a ser el que era antes de sufrir el accidente que le dejaría amnésico. Película basada en el cómic "Valiant", creado por Kevin VanHook, Don Perlin y Bob Layton.','/zlqMASc3vEtdym2OvXgE7fC6onT.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(602063,'Kenshin, el guerrero samurái: El final','Kenshin Himura (Takeru Satoh) es un legendario espadachín. Tras la Restauración Meiji, ha dejado de matar con la espada. Intenta llevar una vida tranquila con Kaoru Kamiya que dirige una escuela de espadachines en el pueblo. Todo cambia cuando el restaurante Akabeko, que es el lugar favorito de Kenshin para comer, es destruido y él encuentra una nota en la que pone "Junchu".','/nR6tcBslmfpC6tHW6GPs7fcHV8g.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(604360,'La 8.ª noche','Con cuentas de oración en una mano y un hacha en la otra, un monje persigue a un espíritu milenario que posee a los humanos y desata el infierno en la Tierra.','/4jKbWxfIpuzPvSCUKGVVjF2L5mV.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(602734,'Spiral: Saw','El detective descarado Ezekiel "Zeke" Banks, y su compañero novato, se hacen cargo de una espeluznante investigación sobre varios asesinatos espansosos. Zeke, involuntariamente, se vera atrapado en el  morboso juego del asesino.','/g15PR8eQV9DehSWlagvdnJZqoRq.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(719088,'Yes ka No ka Hanbun ka','Kei Kunieda es un joven y popular presentador de televisión que mantiene su fachada de perfección ante las cámaras, pero que en privado maldice la inutilidad y la estupidez de todos en su entorno. Sin embargo, debido a ciertas circunstancias, un día el guionista de animación Ushio Tsuzuki descubre el lado más ácido de Kei.','/yjmqROw9fa9GahuUxvBFnoVYYMG.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(801335,'La chica en el sótano','Sara es una adolescente que está deseando cumplir 18 años para alejarse de su padre controlador, Don. Pero antes de que pudiera apagar las velas, Don la aprisiona en el sótano de su casa.','/vDR2h5uQNgWyx3fsEVnEOcNFibZ.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(678580,'El mesero','','');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(38700,'Bad Boys for Life','El Departamento de Policía de Miami y su equipo de élite AMMO intentan derribar a Armando Armas, jefe de un cartel de la droga. Armando es un asesino de sangre fría con una naturaleza viciosa y contaminante. Él está comprometido con el trabajo del cartel y es enviado por su madre Isabel, para matar a Mike.','/3N316jUSdhvPyYTW29G4v9ebbcS.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(153104,'Wicked Minds','','/oYiPf8oR2ZrjvGIVzGTw1BZihDP.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(299536,'Vengadores: Infinity War','El todopoderoso Thanos ha despertado con la promesa de arrasar con todo a su paso, portando el Guantelete del Infinito, que le confiere un poder incalculable. Los únicos capaces de pararle los pies son los Vengadores y el resto de superhéroes de la galaxia, que deberán estar dispuestos a sacrificarlo todo por un bien mayor. Capitán América e Ironman deberán limar sus diferencias, Black Panther apoyará con sus tropas desde Wakanda, Thor y los Guardianes de la Galaxia e incluso Spider-Man se unirán antes de que los planes de devastación y ruina pongan fin al universo. ¿Serán capaces de frenar el avance del titán del caos?','/lmZFxXgJE3vgrciwuDib0N8CfQo.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(611489,'Iniciación','Una ola de asesinatos desata el pánico en la universidad de Whiton. Todos los crímenes tienen como nexo las redes sociales, y tres amigas de una sororidad deciden investigarlos, poniendo al descubierto los secretos más oscuros de la academia.','/4qdalDaJDy6LSBNapxmCc4Wvpls.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(645856,'Y al séptimo día','Un reconocido exorcista se reúne con un sacerdote novicio en su primer día de entrenamiento. A medida que descubren el infierno que existe sobre la Tierra, las líneas entre el bien y el mal se distorsionan, dando lugar a que emerjan sus propios demonios.','/xH23sRbfMtwZ2oBtBf607VUNrGt.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(775996,'A descubierto','Un piloto de drones se une a un oficial androide para localizar un dispositivo que amenaza con acabar con la vida sobre el planeta. El dispositivo en cuestión se encuentra oculto en una zona altamente militarizada.','/lOSdUkGQmbAl5JQ3QoHqBZUbZhC.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(522931,'El otro guardaespaldas 2','La pareja más letal del mundo, el guardaespaldas Michael Bryce y el asesino a sueldo Darius Kincaid, están de vuelta en otra misión que amenaza su vida. Aún sin licencia y bajo escrutinio, Bryce se ve obligado a actuar por la esposa aún más volátil de Darius, la infame estafadora internacional Sonia Kincaid. Mientras Bryce es conducido al límite por sus dos protegidos más peligrosos, el trío se mete en la cabeza en una trama global y pronto descubre que son todo lo que se interpone entre Europa y un loco vengativo y poderoso.','/1TkU6gJNpNPZzZdQVvdJCTDi32f.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(539885,'Ava','Ava es una mortífera asesina a sueldo que trabaja para una organización de operaciones encubiertas, que viaja por todo el mundo acabando con aquellos objetivos que nadie más puede derribar. Cuando uno de sus encargos sale mal, Ava tendrá que luchar por una vida.','/54yOImQgj8i85u9hxxnaIQBRUuo.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(744275,'After. Almas perdidas','Cuando Tessa (Josephine Langford) toma la decisión más importante de su vida, todo cambia. Los secretos que salen a la luz sobre su familia y la de Hardin (Hero Finnes-Tiffin) ponen en peligro su relación y su futuro juntos. La vida de Tessa empieza a romperse en pedazos y ya nada será como antes. Aunque sabe que Hardin la quiere, estas dos almas perdidas están rodeadas de celos, odio... y perdón. Hasta ahora, el amor era suficiente para mantener su relación a flote, pero ¿de verdad sigue mereciendo la pena?','');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(736073,'Batman: El Largo Halloween, Parte 1','Inspirado en la icónica historia de DC de mediados de la década de 1990 de Jeph Loeb y Tim Sale, Batman: El Largo Halloween, Parte 1 comienza cuando un brutal asesinato en Halloween impulsa al joven justiciero de Gotham, Batman, a formar un pacto con los dos únicos agentes de la ley incorruptos de la ciudad para acabar con The Roman. Pero cuando ocurren más muertes queda claro que, en lugar de la violencia de pandillas común, también están lidiando con un asesino en serie, cuya identidad se vuelve más difícil de discernir.','/uS9apevOgs2fuYghf9szOoK1u63.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(767304,'Día de redención','Acaba de regresar a casa, y la esposa del condecorado capitán de infantería de marina estadounidense Brad Paxton (Gary Dourdan), Kate, es secuestrada por un grupo terrorista mientras trabajaba en Marruecos. Se ve obligado a volver a la acción para una operación atrevida y mortal para salvar a la mujer que ama.','/7vCOBYP52Mm8Nlc09hLUtWfxHjJ.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(664767,'Mortal Kombat Legends: La venganza de Scorpion','Basado en el popular videojuego creado por Ed Boon y John Tovias, Mortal Kombat Legends: Scorpion’s Revenge pone el foco en un torneo único que se celebra una vez por generación y en el que se enfrentan los campeones de distintos reinos. El ganador determinará el destino de la Tierra y de sus habitantes.','/vw3zNfzvnVNF7nIjpiEgcdznfeC.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(412656,'Chaos Walking','Todd Hewitt es el último chico de Prentisstown, una pequeña comunidad cuya peculiaridad (aparte del hecho de que no hay mujeres) es que todos escuchan los pensamientos ajenos, lo que es definido como Ruido, un ruido que nunca cesa. Todd está contento porque sólo falta un mes para que sea su decimotercer cumpleaños y por fin, se convierta en hombre. Pero entonces, en uno de sus paseos por el bosque con su fiel perro, encuentra algo inesperado que cambiará su mundo para siempre: el silencio. O como lo define Todd: un agujero en el ruido.','/ovggmAOu1IbPGTQE8lg4lBasNC7.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(845222,'Kingdom: La historia de Ashin','Un misterioso descubrimiento aviva la sed de venganza de una mujer que ha perdido a toda su familia. Episodio especial de Kingdom, centrado en el personaje de Ashin, que apareció brevemente al final de la segunda temporada.','/pfcj8IYB5bK8RTWiHwOCGfIzVw6.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(581389,'Barrenderos espaciales','En 2092, la tripulación de una nave basurero espacial llama Victory descubre un robot humanoide llamado Dorothy, un arma de destrucción masiva, y se ven envueltos en un negocio de alto riesgo.','/drulhSX7P5TQlEMQZ3JoXKSDEfz.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(784500,'Pretty Guardian Sailor Moon Eternal: La película - 2.ª parte','Hotaru comienza a envejecer rápidamente mientras se encuentra al cuidado de las Guardianas Exteriores. Después, ¡es el momento de que todas las Guardianas se reúnan!','/4QA7pKpmNgeXkhN1FFIBelHwr6V.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(656940,'El traficante','Utah y su novia Opal son drogadictos que viven en las calles de la zona rural de Ohio. Después de ser reclutado por el agente corporal Wood y ofrecerle tratamiento en Los Ángeles, Wood toma Utah bajo su protección y le presenta al magnate del centro de tratamiento Vin. Wood y Vin traen a Utah en sus negocios lucrativos e ilegales, donde salvar vidas es lo segundo en la línea de fondo.','/caWb61PBLJOdnnVYnL8WU6I80kE.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(400160,'Bob Esponja: Un héroe al rescate','Cuando desaparece su amigo Gary, Bob Esponja se embarca en una alocada misión con Patricio muy lejos de Fondo de Bikini para rescatarlo.','/wu1uilmhM4TdluKi2ytfz8gidHf.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(512200,'Jumanji: siguiente nivel','En esta ocasión, los ´jugadores´ vuelven al juego, pero sus personajes se han intercambiado entre sí, lo que ofrece un curioso plantel: los mismos héroes con distinta apariencia. Pero, ¿dónde está el resto de la gente? Los participantes sólo tienen una opción: jugar una vez más a esta peligrosa partida para descubrir qué es realmente lo que está sucediendo.','/zTxHf9iIOCqRbxvl8W5QYKrsMLq.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(643586,'Willy´s Wonderland','Cuando su coche se avería, un tranquilo solitario acepta limpiar un centro de diversión familiar abandonado a cambio de reparaciones. Pronto se encuentra librando una guerra contra las mascotas animatrónicas poseídas mientras está atrapado dentro de Willy´s Wonderland.','/jFINtstDUh0vHOGImpMAmLrPcXy.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(531219,'Las brujas (de Roald Dahl)','Un pequeño huérfano a finales de 1967, se va a vivir con su querida abuela a Demopolis, un pueblo de Alabama. El niño y su abuela tienen extraños encuentros con algunas brujas por lo que deciden mudarse a un hotel de lujo en la costa. Por desgracia, llegan exactamente al mismo tiempo que la Gran Bruja que ha reunido a sus compinches de todo el planeta -que van de incógnito- para llevar a cabo sus horribles planes.','/8rIoyM6zYXJNjzGseT3MRusMPWl.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(299534,'Vengadores: Endgame','Después de los eventos devastadores de ´Vengadores: Infinity War´, el universo está en ruinas debido a las acciones de Thanos. Con la ayuda de los aliados que quedaron, los Vengadores deberán reunirse una vez más para intentar deshacer sus acciones y restaurar el orden en el universo de una vez por todas, sin importar cuáles sean las consecuencias... Cuarta y última entrega de la saga "Vengadores".','/7RyHsO4yDXtBv1zUU3mTpHeQ0d5.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(553604,'Un ladrón honesto','Un atracador de bancos se entrega a la policía porque se ha enamorado y decide llevar una vida honrada. Cuando descubre que los federales son aún más corruptos que él, se verá obligado a utilizar todas sus artimañas de ex marine para limpiar su nombre.','/2M2JxEv3HSpjnZWjY9NOdGgfUd.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(590706,'Jiu Jitsu','Cada seis años, una antigua orden de luchadores de jiu-jitsu une fuerzas para luchar contra una feroz raza de invasores alienígenas. Pero cuando un célebre héroe de guerra cae derrotado, el destino del planeta y la humanidad está en juego.','/jeAQdDX9nguP6YOX6QSWKDPkbBo.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(800669,'La horma de su zapato','Las chispas saltan cuando una bloguera de moda en Bali conoce a un talentoso zapatero, lo que la lleva a cuestionar su compromiso con su prometido.','/mfRGScUMc88E83bEY12gLTXm2AL.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(630586,'Wrong Turn. Sendero al infierno','Jen y un grupo de amigos se dispusieron a caminar por el sendero de los Apalaches. A pesar de las advertencias de que se adhieran al sendero, los excursionistas se desvían del rumbo y se adentran en tierras habitadas por The Foundation, una comunidad oculta de habitantes de las montañas que utilizan medios letales para proteger su forma de vida. De repente, bajo asedio, Jen y sus amigos parecen dirigirse al punto sin retorno, a menos que el padre de Jen pueda llegar a tiempo.','/6XVqVAMOsKL5C26pHesiAawuGYW.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(842171,'Sueño mortal (Deep)','Tras sumarse a un experimento neurocientífico que no funciona como esperaban, cuatro estudiantes insomnes deberán encontrar una salida antes de que sea demasiado tarde.','/kroGs6BT7NuMQgYF4Mo32eKaSES.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(317442,'The Last: Naruto la Película','Han pasado dos años desde que acabó la Cuarta Guerra Shinobi y con ello la última pelea entre Naruto y Sasuke. Konoha se encuentra en paz, pero un nuevo enemigo amenaza esta paz. La luna que fue creada por el sabio de los seis caminos cuando sello al Jūbi, se perturba y empieza a dirigirse a la tierra en forma de un meteorito gigante, se descubre que el causante de esta inminente tragedia es alguien llamado Toneri Ōtsutsuki quien es el último descendiente del Clan Ōtsutsuki, cuyos miembros habitaron en la luna los último mil años. En medio del inminente desastre Toneri Ōtsutsuki intenta secuestrar a Hinata, pero Hannabi, la hermana menor, es quien termina siendo raptada, es entonces donde Naruto y los demás deberán rescatarla y vencer a Toneri Ōtsutsuki antes de que sea demasiado tarde y así descubrir las verdaderas intenciones de Ōtsutsuki.','/kzIiKLccwuzD3qD5OHFyPIkiqEw.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(429617,'Spider-Man: Lejos de casa','Peter Parker decide irse junto a Michelle Jones, Ned y el resto de sus amigos a pasar unas vacaciones a Europa después de los eventos ocurridos en Vengadores: EndGame. Sin embargo, el plan de Parker por dejar de lado sus superpoderes durante unas semanas se ven truncados cuándo es reclutado por Nick Fury para unirse a Mysterio (un humano que proviene de la Tierra 833, una dimensión del multiverso, que tuvo su primera aparición en Doctor Strange) para luchar contra los elementales (cuatro entes inmortales que vienen de la misma dimensión y que dominan los cuatro elementos de la naturaleza, el fuego, el agua, el aire y la tierra) . En ese momento, Parker vuelve a ponerse el traje de Spider-Man para cumplir con  su labor.','/8XiTPU1zfy41Xgg96TCHXj4uQJf.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(347201,'Boruto: Naruto La Pelicula','Han pasado algunos años desde el final de la Guerra Shinobi. Naruto Uzumaki es el séptimo Hokage de Konoha, en esta nueva era. Su hijo, Boruto Uzumaki, pronto entrará en los exámenes de Chunin, junto Sarada Uchiha y el misterioso Mitsuki.','/zLTfRrrVXNW3OWUk6U1eFZhB18m.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(545609,'Tyler Rake','Tyler Rake, un intrépido mercenario que ofrece sus servicios en el mercado negro, emprende una peligrosa misión cuando es contratado para rescatar al hijo secuestrado de un señor del crimen de Bombay.','/1R6cvRtZgsYCkh8UFuWFN33xBP4.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(812456,'Barbie y Chelsea, el cumpleaños perdido','La familia Roberts se embarca en un crucero de aventuras por el séptimo cumpleaños de Chelsea. Margaret tiene mucho trabajo por hacer, pero le promete a Chelsea que el día siguiente estará dedicado a ella. Chelsea con sus peluches y hermanas, Barbie, Skipper y Stacie, buscan el lugar perfecto en el barco para celebrar el cumpleaños.','/sNQWRiwOc1R261yg7XVXxq0b5F9.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(580532,'Crisis','Tres historias sobre el mundo de los opiáceos chocan entre sí: un traficante de drogas planea una operación que implica a varios cárteles entre Canadá y los Estados Unidos; un arquitecto que se recupera de una fuerte adicción al OxyContin descubre la verdad que esconde su hijo de su relación con la droga; un profesor de universidad trata de averiguar qué relación une al gobierno con una compañía farmacéutica que está diseñando un nuevo analgésico que aseguran no "provoca ninguna adicción".','/gFDOQMQwo5UWegXE5kNEchn1eKx.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(835666,'Cómo hackear a tu jefe','Víctor envía accidentalmente un correo electrónico comprometedor a su molesto jefe. Con la ayuda de su enamorado de la oficina y un amigo despistado, intentará salvar su trabajo mientras tiene que lidiar con un pirata informático de la industria del porno, un juego en línea para niños y Smiley, la mascota de la compañía.','/b2NJHrx796DcD403eZoX4qt7cjf.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(662237,'Dulce y amargo','Una pareja afronta las oportunidades y retos del mundo real mientras lidia con los problemas que conlleva mantener a flote una relación a distancia.','/63xBsC6u54uJggUd7mntwB6RuaN.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(666750,'Dragonheart: Vengeance','Lukas, un joven agricultor cuya familia es asesinada por salvajes guerreros, se embarca en una aventura épica en busca de venganza, formando un trío imposible con un dragón majestuoso y un mercenario espadachín llamado Darius.','/6mKAKhj8POVGqV1GsroS5mGIUe9.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(560144,'Skylines','Cuando un virus amenaza con convertir a los híbridos alienígenas amistosos que ahora habitan la tierra en contra de los humanos, la capitana Rose Corley debe liderar un equipo de mercenarios de élite en una misión al mundo alienígena para salvar lo que queda de la humanidad.','/3ombg55JQiIpoPnXYb2oYdr6DtP.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(651571,'Breach','Un rudo mecánico es elegido para estar despierto y dar mantenimiento al arca interestelar de una nave espacial que mantiene con vida a unos pocos miles de supervivientes de una Tierra moribunda. El peligro llega cuando un alien capaz de cambiar de forma aparece en la nave para acabar con todos los supervivientes.','/nz8xWrTKZzA5A7FgxaM4kfAoO1W.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(514995,'Gully','Tres adolescentes que han crecido en arduas circunstancias, Jessie, Calvin y Nicky, se dedican a ver la vida pasar mientras tratan de averiguar qué han de hacer para poder salir adelante en la vida.','/50kyTkY0ThpptlZfrOdXqEEvmfY.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(578908,'Un mal viaje','Dos amigos se embarcan en un viaje por carretera a través del país haciendo bromas con cámara oculta a la gente.','/a9zFUuxzChmAlIybVge9IZt1hH0.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(571891,'Pokémon: Mewtwo contraataca - Evolución','La aventura comienza con el nacimiento del Pokémon más poderoso del mundo, creado por ingeniería genética utilizando el ADN del legendario Pókemon Mew. Determinado a probar su superioridad, Mewtwo reta a Ash, Pikachu y los mejores entrenadores a una competición de Pókemon como no ha habido otra igual.','/olQLBp49qFpbWSt0z5OdNpFHP3g.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(337401,'Mulán','El emperador de China emite un decreto para reclutar a un varón por cada familia que deberá servir en el ejército imperial para defender al país de los invasores del norte. Hua Mulán, se presenta para evitar que su anciano padre sea llamado a filas. Se hace pasar por un hombre. Mulan deberá apelar a su fuerza interior y sacar a la luz todo su potencial.','/aoHiMjRt0Qs1dtkV61LyxTnQtJl.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(582306,'Assassin 33 A.D.','Mientras investigaban, un grupo de jóvenes genios se topó accidentalmente con un plan terrorista secreto para crear una máquina del tiempo para retroceder en el tiempo y cambiar la historia.','/5VKquU8PNujrxLmsYGHf2TCRNFQ.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(833971,'La Casa de Las Flores: La Película','Spin off de la serie ‘La casa de las flores’ en formato película. Los hermanos De la Mora elaboran un ingenioso plan para irrumpir en su antigua casa familiar y recuperar un importante tesoro escondido.','/5H1NuHeLuApgKhFvhQWoLMBqYa.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(615678,'Patrulla Trueno','En un mundo en el que los supervillanos son algo común, dos amigas de la infancia distanciadas se reúnen después de que una de ellas idee un tratamiento que les da superpoderes para proteger su ciudad.','/z7HLq35df6ZpRxdMAE0qE3Ge4SJ.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(458156,'John Wick: Capítulo 3 - Parabellum','John Wick (Keanu Reeves) regresa a la acción, solo que esta vez con una recompensa de 14 millones de dólares sobre su cabeza y con un ejército de mercenarios intentando darle caza. Tras asesinar a uno de los miembros del gremio de asesinos al que pertenecía, Wick es expulsado de la organización, pasando a convertirse en el centro de atención de multitud de asesinos a sueldo que esperan detrás de cada esquina para tratar de deshacerse de él.','/vVpEOvdxVBP2aV166j5Xlvb5Cdc.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(663558,'Nezha: El renacer de un dios','La historia tiene lugar tres mil años después de "Nezha nao hai". Nezha nace de nuevo ¿Qué desafíos enfrentará en esta vida? Un nuevo superhéroe está naciendo en silencio...','/y0SiXoTLQp93NbLQ4XhgVz18UAS.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(509967,'6 en la sombra','¿Cuál es la mejor parte de estar muerto? No se trata de escapar de tu jefe, de tu ex, de borrar tu historial criminal. La mejor parte de estar muerto es la libertad. Poder acabar con gente mala de verdad, sin tener que responder ante nadie. Liderados por el el enigmático Uno (Ryan Reynolds), seis individuos de distintas partes del mundo han sido elegidos no solo por su habilidad, sino por su deseo de eliminar su pasado para cambiar el futuro. Este equipo de justicieros, que han fingido su muerte, se dedican a desmantelar organizaciones criminales. Y es que, a pesar de estar muertos, harán historia.','/eFw5YSorHidsajLTayo1noueIxI.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(671,'Harry Potter y la piedra filosofal','Harry Potter es un huérfano que vive con sus desagradables tíos, los Dursley, y su repelente primo Dudley. Se acerca su undécimo cumpleaños y tiene pocas esperanzas de recibir algún regalo, ya que nunca nadie se acuerda de él. Sin embargo, pocos días antes de su cumpleaños, una serie de misteriosas cartas dirigidas a él y escritas con una estridente tinta verde rompen la monotonía de su vida: Harry es un mago y sus padres también lo eran.','/4GlSMUpzSd3cliYGFJVziSDX53S.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(638449,'La última carta de amor','Ellie Haworth (Felicity Jones) es una ambiciosa periodista que descubre un tesoro de cartas secretas de amor de 1965 y decide resolver el misterio de esta aventura prohibida. A medida que descubre la historia que hay detrás de Jennifer Stirling (Shailene Woodley), la mujer de un acaudalado empresario, y Anthony O’Hare (Callum Turner), el periodista financiero nombrado para cubrir su vida, la historia de amor de la propia Ellie comienza a desarrollarse con la ayuda de un archivista serio y adorable (Nabhaan Rizwan) que la ayuda a localizar más cartas.','/AmzVV7kqds8BJBXwnQtx5YpqFdU.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(354912,'Coco','Miguel es un joven con el sueño de convertirse en leyenda de la música a pesar de la prohibición de su familia. Su pasión le llevará a adentrarse en la "Tierra de los Muertos" para conocer su verdadero legado familiar.','/gKZAQ3b9yApxFunUBlS5Mp74QG4.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(793723,'Centinela','Enviada a casa tras una traumática misión de combate, una soldado francesa de élite usa sus habilidades letales para dar caza al hombre que agredió a su hermana.','/eTgQlyIQH0nA5BsmYpvCzSPAorg.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(505262,'My Hero Academia: Dos héroes','All Might y Deku aceptan una invitación para visitar una ciudad flotante llamada I Island donde conocen a una chica y pelean contra un villano que tiene a toda la isla de rehén.','/uicia399gyMGE1smatJ41M0CtFx.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(736069,'Justice Society: World War II','Mientras acelera para ayudar en una batalla improvisada, Flash arde y atraviesa la barrera  del tiempo, solo para encontrarse con su antecesar en medio de la Segunda Guerra Mundial. Es aquí donde Flash conoce a la Mujer Maravilla y su equipo secreto, conocido como la Sociedad de la Justicia de América. ¡Sé testigo de las furiosas mareas de la guerra, el combate apasionante y la velocidad del valor mientras Flash lucha por volver a su propia línea de tiempo!','/8LHSDyRizQ4kQz5rEHPKyXPvMG3.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(776503,'CODA','Como CODA, hija de adultos sordos, Ruby es la única persona oyente en su familia sorda. Cuando el negocio pesquero de la familia se ve amenazado, Ruby se encuentra dividida entre perseguir su amor por la música y su miedo a abandonar a sus padres.','/4Tz8V8aRim8cFgKEWprSUjBy8tY.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(717192,'Ferry','Antes de crear un emporio de la droga, Ferry Bouman vuelve a su ciudad para vengarse. Allí se pondrá a prueba su lealtad y el amor le cambiará la vida.','/fejok33Ijc6SppiEU1cfwA9Mo2.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(522938,'Rambo: Last Blood','Después de luchar contra sus demonios durante décadas, John Rambo vive ahora en paz en su rancho familiar en Arizona, pero su descanso se ve interrumpido cuando Gabriela, la nieta de su ama de llaves María, desaparece después de cruzar la frontera con México con el propósito de conocer a su padre biológico. Rambo, que con los años se ha convertido para Gabriela en una verdadera figura paterna, emprende un desesperado y peligroso viaje para encontrarla.','/pAsZ0ifQwKTHVab8bCHHn2qtizE.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(788210,'Un destello en la niebla','Ruby tiene la esperanza de un nuevo comienzo con su hermana gemela mientras continúan su educación en un internado para niñas. Sin embargo, pronto soporta tortuosos castigos y humillaciones públicas mientras su cruel directora y madrastra conspiran contra ella.','/2jGut3uJrr77vi3BHbkAHVF1I7F.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(400155,'Hotel Transilvania 3: Unas vacaciones monstruosas','Nuestra familia de monstruos favorita se embarca en un crucero de lujo para que por fin Drac pueda tomarse un descanso de proveer de vacaciones al resto en el hotel. Es una navegación tranquila para la pandilla de Drac, ya que los monstruos se entregan a toda la diversión a bordo que ofrece el crucero, desde el voleibol de monstruos y las excursiones exóticas, a ponerse al día con sus bronceados de luna. Pero las vacaciones de ensueño se convierten en una pesadilla cuando Mavis se da cuenta de que Drac se ha enamorado de la misteriosa capitana de la nave, Ericka, quien esconde un peligroso secreto que podría destruir a todos los monstruos.','/m03jul0YdVEOFXEQVUv6pOVQYGL.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(644083,'Twist','Un clásico de Dicken actualizado de forma emocionante en el corazón del Londres moderno, donde un grupo de jóvenes estafadores inteligentes planean el atraco del siglo para el mejor día de pago.','/jnq4fV53Px9HvUZD2bQIxtGSwS7.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(447332,'Un lugar tranquilo','Evelyn y Lee Abbott son una pareja con tres hijos que vive en una granja aislada de toda civilización al norte de Nueva York. Esta familia ha sobrevivido durante meses en un mundo invadido y amenazado por mortales criaturas extraterrestres que se guían por el sonido para cazar. En este contexto en el que una palabra puede significar la muerte, la familia Abbott vive silenciosamente, andan descalzos y se comunican por medio del lenguaje de señas.','/roYyPiQDQKmIKUEhO912693tSja.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(259693,'Expediente Warren: El caso Enfield','Secuela de la exitosa ´Expediente Warren´ (2013), que lleva de nuevo a la pantalla otro caso real de los expedientes de los renombrados demonólogos Ed y Lorraine Warren. En este caso ambos viajarán al norte de Londres para ayudar a una madre soltera que tiene a su cargo cuatro hijos y que vive sola con ellos en una casa plagada de espíritus malignos.','/4mfFtlGeInPrQVm1hpv7th02yjx.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(577922,'Tenet','Armado solamente con una palabra, Tenet, el protagonista deberá luchar por la supervivencia del mundo entero y evitar la Tercera Guerra Mundial, en una historia de espionaje internacional. La misión se desplegará más allá del tiempo real. No son viajes en el tiempo, es inversión.','/wzJRB4MKi3yK138bJyuL9nx47y6.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(522406,'Flashback','Fred es un tipo normal, un joven que se acerca a sus 30 años y que se encuentra en medio de una crisis existencial debido a que este está a punto de alcanzar la edad adulta en todo su esplendor. Tras un encuentro fortuito con un hombre de su pasado, Fred comienza a revivir el mismo. El joven deberá tratar de resolver el misterio en torno a la desaparición de una chica, detener el auge de una droga llamada Mercury, y también derrotar a una terrorífica criatura que le ha seguido desde su infancia hasta el día de hoy.','/lwRhCxyEiGdvhjCWuLpOANthysH.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(741074,'Érase una vez un muñeco de nieve','Los primeros días de vida del pequeño Olaf, cuándo y por qué cobra vida y cómo empieza a buscar su propia identidad, después de la huída de Elsa del palacio de Arendelle.','/DA7gzvlBoxMNL0XmGgTZOyv67P.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(768744,'My Hero Academia: World Heroes´ Mission','','/2RHjd10wqv57xYzZkNK8Sl09Ddt.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(714277,'La funeraria','La muerte no es algo extraño para Bernardo, su esposa Estella y su hijastra Irina, ya que regentan una funeraria. Pero una cosa son los cadáveres inertes y otra muy distinta los espíritus que vagan por el lugar y que fuerzan a la familia a limitar los espacios de la casa por los que pueden transitar. La mayoría son presencias tétricas pero inofensivas, hasta que un día se hace evidente que hay algo entre las sombras que realmente quiere hacerles daño...','/3GW0A72MxsSgghqpjc2O2MvO8Ec.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(345940,'Megalodón','Un sumergible de aguas profundas que forma parte de un programa internacional de vigilancia submarina, ha sido atacado por una enorme criatura que se creía extinta. Ahora está averiado en el fondo de la fosa oceánica más profunda del Pacífico con su tripulación atrapada en el interior. El tiempo se acaba y, en contra de los deseos de su hija Suyin (Li Bingbing), un visionario oceanógrafo chino (Winston Chao) contrata a Jonas Taylor (Jason Statham), un especialista en rescate en aguas profundas. Su misión será salvar a la tripulación y también al océano de una amenaza imparable: un tiburón prehistórico de 23 metros conocido con el nombre de Megalodón.','/rH79sB6Nkx4cMW3JzsUy7wK0rhX.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(631939,'The Legion','A Noreno, medio romano, se le confía la misión de cruzar las montañas nevadas de Armenia, plagado de patrullas partas, para buscar ayuda para sus hombres que mueren lentamente.','/9NlswPRK5Kap6KVr59Feah9EBLP.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(290859,'Terminator: Destino oscuro','Sarah Connor une todas sus fuerzas con una mujer cyborg para proteger a una joven de un extremadamente poderoso y nuevo Terminator.','/a6cDxdwaQIFjSkXf7uskg78ZyTq.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(320288,'X-Men: Fénix oscura','Los X-Men se enfrentan a su enemigo más poderoso: uno de sus miembros, Jean Grey. Durante una misión de rescate en el espacio, Jean casi muere al ser alcanzada por una misteriosa fuerza cósmica. Cuando regresa a casa, esa radiación la ha hecho más poderosa, pero mucho más inestable. Mientras lucha con la entidad que habita en su interior, Jean desata sus poderes de formas que no puede controlar ni comprender. Jean cae en una espiral fuera de control haciendo daño a aquellos que más ama y empieza a destruir los lazos que mantienen unidos a los X-Men.','/cjRUhKyt2Jo3V1KNzc5tpPNfccG.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(138843,'Expediente Warren: The Conjuring','Basada en una historia real documentada por los reputados demonólogos Ed y Lorraine Warren. Narra los encuentros sobrenaturales que vivió la familia Perron en su casa de Rhode Island a principios de los 70. El matrimonio Warren, investigadores de renombre en el mundo de los fenómenos paranormales, acudieron a la llamada de esta familia aterrorizada por la presencia en su granja de un ser maligno.','/l5yp73psXVRYy2ce09lD8yDuu2g.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(785537,'Aquel verano','Para Deniz, un adolescente de 16 años, este verano es diferente a los demás. Deniz, que va a la casa de verano de su familia todos los años, se enamora de una joven llamada Aslı. Al tratar de acercarse a Aslı, Deniz se da cuenta de que a un joven apuesto, Burak, también le gusta Aslı.','/e0lVsZrD6CPX8pt0QIDK7HDoRpy.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(474350,'It: Capítulo 2','Han pasado casi 30 años desde que el "Club de los Perdedores", formado por Bill, Beverly, Richie, Ben, Eddie, Mike y Stanley, se enfrentaran al macabro y despiadado Pennywise (Bill Skarsgård). En cuanto tuvieron oportunidad, abandonaron el pueblo de Derry, en el estado de Maine, que tantos problemas les había ocasionado. Sin embargo, ahora, siendo adultos, parece que no pueden escapar de su pasado. Todos deberán enfrentarse de nuevo al temible payaso para descubrir si de verdad están preparados para superar sus traumas de la infancia.','/8moTOzunF7p40oR5XhlDvJckOSW.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(649087,'Punto rojo','Cuando Nadja queda embarazada, tanto ella como su pareja intentan reconducir su relación viajando al norte de Suecia para practicar montañismo. Sin embargo, su escapada romántica no tarda en convertirse en una auténtica pesadilla.','/7KL4yJ4JsbtS1BNRilUApLvMnc5.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(537915,'After: Aquí empieza todo','La joven Tessa Young cursa su primer año en la universidad. Acostumbrada a una vida estable y ordenada, su mundo cambia cuando conoce a Hardin Scott, un misterioso joven de oscuro pasado. Desde el primer momento se odian, porque pertenecen a dos mundos distintos y son completamente opuestos. Sin embargo, estos dos polos opuestos pronto se unirán y nada volverá a ser igual. Tessa y Hardin deberán enfrentarse a difíciles pruebas para estar juntos. La inocencia, el despertar a la vida, el descubrimiento sexual y las huellas de un amor tan poderoso como la fuerza del destino.','/997ToEZvF2Obp9zNZbY5ELVnmrW.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(602269,'Pequeños detalles','Joe ´Deke´ Deacon, ayudante de sheriff del condado de Kern, es enviado a Los Angeles para lo que debería ser un caso rápido de recopilación de evidencias. Sin embargo, se ve involucrado en la búsqueda de un asesino en serie que aterroriza a la ciudad. Encabezando la investigación se encuentra el sargento del departamento del sheriff de Los Angeles, Jim Baxter, quien, impresionado por el instinto policial de Deke, le ayuda de manera extraoficial. Pero mientras siguen la pista al asesino, Baxter desconoce que la investigación desentierra partes del pasado de Deke que sacan a la luz secretos más peligrosos que el propio caso.','/vfuzELmhBjBTswXj2Vqxnu5ge4g.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(802504,'Solo di que sí','La romántica incurable Lotte (Yolanthe Cabau) ha estado planeando su boda perfecta durante años, pero ve cómo su sueño se hace añicos cuando el novio decide cancelarla en el último minuto.','/jw0849O7WLarbYKJkA9WpRLeGKG.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(676842,'Después de ti','Su, una mujer que no tiene amigas, se ve obligada a seguir una lista de absurdas instrucciones para superar la inesperada muerte de su prometido .Entre ellas: Hacer una amiga. Sus mejores amigos, Gil y Matías, la acompañan en sus intentos desatinados hasta que conoce a Ana. Quien la ayuda a recobrar su lado femenino y a reencontrarse a sí misma.','/mi76WsBDStlmU1taHXasYh10LEm.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(532067,'Kono Subarashii Sekai ni Shukufuku wo!: Kurenai Densetsu','La vida del amante de los videojuegos, Satou Kazuma, termina cuando es arrollado por un camión. En un inesperado giro del destino reencarna en otro mundo gracias a la diosa Aqua, a una torpe hechicera llamada Megumin y a una delirante caballero llamada Darkness. En esta película este peculiar grupo se enfrentará a una increíble amenaza. ¿Podrán salvar la Villa Carmesí? ¿Qué pasará con Kazuma?','/m5HPKCi7GdhKmxPTcOQmcLfEmZ9.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(685264,'Pray Away: Reza y dejarás de ser gay','Una poderosa exposición sobre los programas de conversión gay, que revela el daño infligido por la vergüenza y la represión a través de testimonios íntimos de miembros actuales y ex líderes del movimiento reza por el alejamiento gay.','/G3vrVlsqsNPSYvyoG2lTRxVGom.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(672,'Harry Potter y la cámara secreta','Harry regresa a su segundo año a Hogwarts, pero descubre que cosas malas ocurren debido a que un sitio llamado la Cámara de los Secretos ha sido abierto por el heredero de Slytherin y hará que los hijos de muggles, los impuros, aparezcan petrificados misteriosamente por un animal monstruoso.','/1stUIsjawROZxjiCMtqqXqgfZWC.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(566525,'Shang-Chi y la leyenda de los Diez Anillos','Shang-Chi debe enfrentarse al pasado que pensó que había dejado atrás cuando se ve atraído por la red de la misteriosa organización de los Diez Anillos.','/c4lQ9UYLeanBAmoJDcv5MMDioNG.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(461130,'Code 8','En Lincoln City algunos habitantes tienen habilidades extraordinarias. La mayoría vive por debajo del umbral de la pobreza, bajo la estrecha vigilancia de una fuerza policial fuertemente militarizada. Connor, un trabajador de la construcción con poderes, se une a una banda criminal para ayudar a su madre enferma. (Basada en el cortometraje «Code 8», 2016.)','/wlnDNMQlnwl5ETlVY6n9CEtR5s0.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(606523,'Noche en el paraíso','Un gángster intenta limpiar su vida para cuidar a su hermana y sobrino enfermos. Pero alguien que lo apuntaba accidentalmente los mata en su lugar. En estado de shock, decide vengarse.','/15BJ65zMu2bBQEztTvqTAoobAKB.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(674,'Harry Potter y el cáliz de fuego','En el cuarto año en Hogwarts, Harry se enfrenta al mayor de los desafíos y peligros de la saga. Cuando es elegido bajo misteriosas circunstancias como el competidor que representará a Hogwarts en el Torneo Triwizard, Harry deberá competir contra los mejores jóvenes magos de toda Europa. Pero mientras se prepara, aparecen pruebas que manifiestan que Lord Voldemort ha regresado. Antes de darse cuenta, Harry no solo estará luchando por el campeonato sino también por su vida','/8f9dnOtpArDrOMEylpSN9Sc6fuz.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(385687,'Fast & Furious 10','Décima y penultima entrega de la franquicia central de Fast & Furious.  Se conoció el día martes 20 de octubre del 2020, que el final de esta saga de acción, autos y máxima adrenalina contará con Justin Lin como director de ambas películas.  Las cintas diez y once no supondrán, sin embargo, el final definitivo de ‘Fast & Furious’ sino solo el cierre de su trama central puesto que está previsto que se hagan películas derivadas que amplíen el universo narrativo de estas historias.','');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(581392,'Península','Cuatro años después de la epidemia zombie, Corea sigue infestada de monstruos y el soldado Jung-seok, que escapó del país, se ve obligado a regresar a Seúl para recuperar un objeto valioso. Allí descubre que hay, todavía, personas sanas en la ciudad. Continuación de la aclamada película de zombis "Train to Busan".','/d2UxKyaJ5GgzuHaSsWinFfv3g6L.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(691179,'Friends: The Reunion','El reparto de la mítica serie "Friends" -que duró 10 temporadas (1994-2004)- se reúne para un especial en la nueva plataforma HBO Max en la que recuerdan numerosas anécdotas del rodaje, reciben a celebridades y a algunos invitados que pasaron por la serie, y reflexionan sobre la importancia para ellos de la serie y las consecuencias de su enorme fama sobre sus vidas.','/hP7dN2B5ztQgSIN5Qvk63MY4EeO.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(297761,'Escuadrón suicida','Mientras el gobierno de EE.UU no tiene claro cómo responder a una visita alienígena a la Tierra con intenciones malignas, Amanda ´El Muro´ Waller, la líder de la agencia secreta A.R.G.U.S., ofrece una curiosa solución: reclutar a los villanos más crueles, con habilidades letales e incluso mágicas, para que trabajen para ellos. Sin demasiadas opciones a dar una negativa, los ocho supervillanos más peligrosos del mundo acceden a colaborar con el Ejecutivo en peligrosas misiones secretas, casi suicidas, para así lograr limpiar su expediente.','/sMRwI5trKI6qhxYcjPgGghmPBef.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(346687,'El hombre agua','Gunner y su madre comparten un vínculo especial. Ella apoya sus actividades artísticas y de ensueño, mientras que su padre, Amos, quien viaja con frecuencia, con quien Gunner comparte una relación tensa, tiene otras ideas sobre dónde deberían estar los intereses de su hijo. Gunner y su padre intentan suavizar sus diferencias por el bien de la familia, pero cuando la enfermedad de su madre empeora, Gunner desaparece en montones de libros sobre ciencia y lo sobrenatural en busca de posibles curas. Cuando Gunner y su rebelde amigo Jo desaparecen durante su búsqueda en el misterioso bosque del Hombre del Agua, Amos debe sumergirse en el mundo de su hijo para encontrarlos y volver a unir a su familia.','/9lropttr13U34csVkseFGZY98Kl.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(681260,'Maya y el Orbe Dorado','La abeja Maya y su mejor amigo, Willi, rescatan a una princesa hormiga y se ven envueltos en una batalla épica entre insectos que les llevará a mundos desconocidos y pondrá a prueba su amistad.','/7HtvmsLrDeiAgDGa1W3m6senpfE.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(520901,'Doom: Annihilation','Sigue a un grupo de marines espaciales que responden a una llamada de socorro desde una luna de Marte. Cuando llegan allí, descubren que criaturas demoníacas han tomado el control de la zona y amenazan con llevar el Infierno a la Tierra. Nueva película basada en la saga de videojuegos “Doom”.','/kNGW6f47HUk0hISjj1AvXoLNL3L.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(772173,'Los Dias Que No Estuve','Un conductor de televisión de pronto se da cuenta que tiene la oportunidad de fingir su propia muerte. Y lo hace. Pero una vez concretado su plan se reencontrará con su hija, a la cual abandonó muchos años atrás.','');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(818809,'Una Cenicienta moderna: Salto a la fama','Finley Tremaine, una chica campestre y de pueblo, desea extender sus alas y echar a volar para convertirse en actriz. Cuando un equipo de rodaje de Hollywood llega a su tranquilo pueblo, está decidida a conseguir un papel en la producción y llama la atención del atractivo actor principal, Jackson Stone. Desafortunadamente, una chapuza de audición la obliga a cambiar de rumbo.','/vRtaOcBs5ViVjquEtAGpzsqIjFE.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(682254,'¡Scooby-Doo! La Leyenda de Scoobydur','Scooby-Doo y su pandilla viajan al pasado para ayudar al rey Arturo a proteger su trono de una malvada hechicera.','/psTz3J2QXVKTQCGrPDFuC4kAOLb.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(675,'Harry Potter y la Orden del Fénix','Harry Potter regresa por quinto año a Hogwarts aún sacudido por la tragedia ocurrida en el Torneo de los Tres Magos. Debido a que el Ministro de la Magia niega el regreso de Lord Voldemort, Harry se convierte en el centro de atención de la comunidad mágica. Mientras lucha con sus problemas en el colegio, incluyendo a la nueva profesora Dolores Umbridge, intentará aprender más sobre la misteriosa Orden del Fénix.','/7qKWTyYvkyIrWgkUOHiNxHv3FNK.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(303857,'Dragon Ball Z: La resurrección de Freezer','Después de que Bills, el Dios de la destrucción, decidiera no destruir la Tierra, se vive una gran época de paz. Hasta que Sorbet y Tagoma, antiguos miembros élite de la armada de Freezer, llegan a la Tierra con el objetivo de revivir a su líder por medio de las Bolas de Dragón. Su deseo es concedido y ahora Freezer planea su venganza en contra de los Saiyajin. La historia hace que una gran oleada de hombres bajo el mando de Freezer lo acompañe.','/kIgfFzjjBNgx6Tr2LCw8Zkq921s.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(198663,'El corredor del laberinto','Thomas abre los ojos y se da cuenta que está en un ascensor. Lo extraño es que no recuerda nada, ni dónde está, ni quién es. Lo único que aún permanece intacto en su memoria es su nombre, y ya es mucho. Antes de que le dé tiempo a cuestionarse algo sobre sí mismo las puertas se abrirán y aparecerá ante él un extraño mundo. Todo lo que ve son chicos de su edad que tienen su mismo estado de amnesia. Una aventura fantástica que pronto destapará la dura realidad bajo ese velo de incertidumbre: todos ellos están atrapados en un laberinto. Si quieren tener alguna posibilidad de salir de allí y recuperar su antigua vida y aquello que no son capaces de recordar deberán unir fuerzas para escapar. Un mundo post-apocalíptico que les acorralará e irá un paso por delante será el desafío que tengan que pasar estos jóvenes por la libertad.','/udkrGMA9hsEGkQpmZ31rGpQQKp8.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(351286,'Jurassic World: El reino caído','Tras cuatro años de abandono del complejo turístico Jurassic World, la isla Nublar solo está habitada por los dinosaurios supervivientes, pero el volcán inactivo de la isla comienza a cobrar vida, Owen y Claire montan una campaña para rescatar a los dinosaurios restantes en la isla.','/3s9O5af2xWKWR5JzP2iJZpZeQQg.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(585,'Monstruos, S.A.','Monstruos, S.A. es la mayor empresa de miedo del mundo de los monstruos y James P. Sullivan es uno de sus mejores Asustadores. Sullivan es un imponente personaje recubierto de piel azul con lunares de color violeta que luce dos cuernos, y al que sus amigos llaman Sulley. Mike Wazowski, su Ayudante Asustador, además de su mejor amigo y compañero de habitación, es un monstruo verde, testarudo, tuerto y muy divertido. Asustar a los niños no es un trabajo tan fácil ya que los monstruos creen que son altamente tóxicos y no pueden entrar en contacto con ellos de ninguna manera. El ecléctico reparto también incluye al presidente y consejero delegado de la empresa, un monstruo en forma de cangrejo llamado Henry J. Waternoose, a la recepcionista Celia, una adorable monstrua con cabeza de serpiente, y al sarcástico camaleón llamado Randall Boggs, que quiere arrebatar el título de Mejor Asustador a Sulley.','/c7VbRPlev1bRfKvTxr98erw5T7B.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(665251,'Altered Carbon: Reenfundados','El spin-off, ambientado en el universo de Altered Carbon, en el que gracias a unas baterías implantadas en la nuca, se pueden archivar la memoria y la personalidad, haciendo posible el cambiar a nuevos cuerpos, conocidos como fundas. Esta vez, nos traslada al planeta Latimer. Takeshi Kovacs tiene una nueva misión como parte de los comandos: proteger a una tatuadora de los miembros de la yakuza. Al mismo tiempo, trata de investigar la misteriosa muerte de uno de los jefes de la organización criminal japonesa. Para acompañarle en su misión, tiene a su lado como compañera a una Comando bastante pragmática.','/mluxnTYUSTRh7GtpZmkGAh9L6zQ.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(607383,'Aquaslash','Emociones, escalofríos y comedia deslumbrante se encuentran con pequeños bikinis y un desmembramiento sangriento, en estos misteriosos asesinatos empapados en cloro y sangre.','/eqVgQwv8HfDN2tv4XWhqW5GryV4.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(453405,'Géminis','Henry Bogan, un asesino a sueldo, pretende retirarse porque se siente viejo. Sin embargo, hay alguien que no está dispuesto a permitírselo porque tiene la misión de matarlo: un clon suyo más joven, más rápido y más fuerte.','/c3F4P2oauA7IQmy4hM0OmRt2W7d.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(572154,'Seishun Buta Yarou wa Yumemiru Shoujo no Yume wo Minai','En Fujisawa, donde los cielos son brillantes y los mares brillan, Sakuta Azusagawa está en su segundo año de secundaria. Sus días felices con su novia y estudiante de último año, Mai Sakurajima, se ven interrumpidos con la aparición de su primer amor, Shouko Makinohara. Por razones desconocidas, se encuentra con dos Shouko: una en la escuela secundaria y otra que se ha convertido en una adulta.  Cuando Sakuta se encuentra impotente viviendo con las dos Shouko, la versión adulta causa una gran grieta en su relación con Mai.  En medio de todo esto, descubre que la otra Shouko de escuela secundaria sufre de una enfermedad grave y su cicatriz comienza a latir ...','/5MgMCnslrxQfOfaq6T5ndkLlcCk.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(287947,'¡Shazam!','Todos llevamos un superhéroe dentro, solo se necesita un poco de magia para sacarlo a la luz. Cuando Billy Batson, un niño de acogida de 14 años que ha crecido en las calles, grita la palabra ´SHAZAM!´ se convierte en el Superhéroe adulto Shazam, por cortesía de un antiguo mago. Dentro de un cuerpo musculoso y divino, Shazam esconde un corazón de niño. Pero lo mejor es que en esta versión de adulto consigue realizar todo lo que le gustaría hacer a cualquier adolescente con superpoderes: ¡divertirse con ellos! ¿Volar? ¿Tener visión de rayos X? ¿Disparar un rayo con las manos? ¿Saltarse el examen de sociales? Shazam va a poner a prueba los límites de sus habilidades con la inconsciencia propia de un niño. Pero necesitará dominar rápidamente esos poderes para luchar contra las letales fuerzas del mal que controla el Dr. Thaddeus Sivana.','/qwgGtdlLMKYvT2tV8hLY22syRHN.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(573680,'El destierro','The Banishing cuenta la historia de la casa más encantada de Inglaterra. En la década de 1930, un joven reverendo, su esposa y su hija se mudan a una mansión con un secreto espantoso.','/xrAaJAn3hqkInq5kE1AGJqIGXyT.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(299537,'Capitana Marvel','La historia sigue a Carol Danvers mientras se convierte en uno de los héroes más poderosos del universo, cuando la Tierra se encuentra atrapada en medio de una guerra galáctica entre dos razas alienígenas. Situada en los años 90, ´Capitana Marvel´ es una historia nueva de un período de tiempo nunca antes visto en la historia del Universo Cinematográfico de Marvel.','/w2PMyoyLU22YvrGK3smVM9fW1jj.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(659940,'El efecto Marcus: Los casos del Departamento Q','Cuando Marco, un niño gitano de 14 años sin hogar, es arrestado en el control de fronteras danés por posesión del pasaporte de un funcionario público desaparecido, el inspector de policía Carl Mørck y su equipo del Departamento Q tienen la tarea de encontrar la conexión. El caso anterior contiene varios elementos sospechosos: el servidor público fue acusado de pedofilia poco antes de su desaparición, y su caso se cerró inusualmente rápido. Pero el silencioso y traumatizado Marco se niega a hablar con ellos y no pasa mucho tiempo antes de que esté huyendo de aquellos que pretenden matarlo por lo que él sabe.','/9uGLBzIyP4kSeZO6g65wdTBrcrw.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(442249,'La primera purga: La noche de las bestias','Para mantener durante el resto del año la tasa de criminalidad por debajo del 1% los Nuevos Padres Fundadores de América ponen a prueba una teoría sociológica que da rienda suelta a todo tipo de agresiones durante una noche en una comunidad aislada. Pero cuando la violencia de los opresores se encuentra con la ira de los marginados, el vandalismo explota más allá de esas fronteras “experimentales” para extenderse por todo el país. Detrás de cada tradición hay una revolución. Descubre cómo toda una nación entera abrazó una brutal celebración anual: 12 horas de impunidad criminal. Bienvenidos a un movimiento que comenzó como un simple experimento: LA PRIMERA PURGA: LA NOCHE DE LAS BESTIAS.','/1hJbE72WiRuWH11QPNiHsvt29xA.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(333339,'Ready Player One','Año 2044. Wade Watts es un adolescente al que le gusta evadirse del cada vez más sombrío mundo real a través de una popular utopía virtual a escala global llamada Oasis, hasta que su excéntrico y multimillonario creador muere. Antes de morir, ofrece su fortuna como premio a una elaborada búsqueda del tesoro a través de los rincones más inhóspitos de su creación. Será el punto de partida para que Wade se enfrente a jugadores, poderosos enemigos corporativos y otros competidores despiadados dispuestos a hacer lo que sea, tanto dentro de Oasis como del mundo real, para hacerse con el premio.','/q7fXcrDPJcf6t3rzutaNwTzuKP1.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(611914,'La mensajera','Ezekiel Mannings (Gary Oldman) es un implacable jefe de la mafia dispuesto a todo para matar a Nick Murch (Amit Shah), el único testigo dispuesto a declarar en su contra. Por este motivo, decide contratar a una mensajera (Olga Kurylenko) en moto para que lleve una bomba de gas venenoso, sin que ella lo sepa. Cuando son conscientes de los planes de Mannings, Nick y la chica deciden huir, pero descubren que tendrán que enfrentarse a un ejército de asesinos a sueldo para poder sobrevivir.','/ne4QPHn56Z1vxk6iKJKvDnmNI9Y.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(647302,'Benny loves you','Jack está tratando desesperadamente de encontrar un nuevo comienzo en la vida. Pero cuando tira su querido juguete de la infancia, Benny, se da cuenta que eso solo puede terminar en muerte.','/czHYg6LQ5926OL8wj5kC09pNR12.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(767,'Harry Potter y el misterio del príncipe','En medio de los desastres que azotan a Inglaterra, Harry y sus compañeros vuelven a Hogwarts para cursar su sexto año de estudios; y aunque las medidas de seguridad han convertido al colegio en una fortaleza, algunos estudiantes son víctimas de ataques inexplicables. Harry sospecha que Draco Malfoy es el responsable de los mismos y decide averiguar la razón. Mientras tanto, Albus Dumbledore y el protagonista exploran el pasado de Lord Voldemort mediante recuerdos que el director ha recolectado. Con esto, Dumbledore planea preparar al muchacho para el día de la batalla final.','/kT8bDEAgEYBKhRJtqM97qTw6uRW.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(599845,'El Inmortal: una película de Gomorra','El cuerpo de Ciro se hunde en las aguas oscuras del Golfo de Nápoles. Y a medida que se hunde más y más, surgen recuerdos. Los sonidos amortiguados por el agua se funden con los gritos de las personas que huyen. Es 1980, la tierra tiembla, el palacio se derrumba, pero bajo los escombros se puede escuchar el llanto de un bebé recién nacido vivo. Diez años más tarde, encontramos a ese bebé recién nacido que sobrevive como puede en las calles de Nápoles, el hijo de nadie. Vívidos recuerdos de una educación criminal que lo convirtió en lo que es: Ciro Di Marzio, el Inmortal. Precuela del programa de televisión "Gomorra".','/5gh7y35Y96qt2qZtydsJ52aWD5Y.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(805051,'Los Olchis','Los Ogglies buscan un nuevo hogar, pero nunca se sienten bienvenidos en ningún sitio. Apestan y la mayoría de los humanos no les quieren. Cuando Firebottom, el dragón de la familia, aterriza en el vertedero de Smelliville, los Ogglies se sienten como en casa. Y es aquí donde quieren quedarse.','/2nU5H8XIgtMkJrxsryP6nJuAHQ.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(337339,'Fast & Furious 8','La carrera ha comenzado. Dom Toretto y su equipo volverán en esta ocasión con más ganas de guerra que nunca. No faltarán los excesos de velocidad y la adrenalina a raudales para un filme del que se espera que sea la entrega con más acción de esta saga callejera por excelencia.','/jzdnhRhG0dsuYorwvSqPqqnM1cV.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(390043,'El otro guardaespaldas','El prestigioso guardaespaldas Michael Bryce recibe un nuevo cliente: un asesino a sueldo, Darius Kincaid, que debe testificar en un juicio en La Haya contra un cruel dictador.','/7KsqfXDECZMryX1Rv4RKsT7SIjQ.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(443791,'Underwater','Un grupo de investigadores submarinos debe ponerse a salvo después de que un terremoto destroce por completo el laboratorio subterráneo en el que trabajaban.','/ww7eC3BqSbFsyE5H5qMde8WkxJ2.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(842561,'Luca: Our Italian Inspiration','','');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(554596,'No manches Frida 2','Zequi (Omar Chaparro) y Lucy (Martha Higareda) están por casarse. Todo parece marchar color de rosa y están a un día de la boda cuando llega la despedida de soltero. A pesar de que él promete portarse bien y no excederse, las cosas se salen de control.','/1TPzecXAb5uCqmscA6WaQqKMmvV.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(513310,'Muere otra vez','Un oficial de las fuerzas especiales ya retirado se ve obligado a vivir una y otra vez en bucle el día de su muerte.','/iueb8P2aSE2JL21kgoyhnmmeFb5.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(673,'Harry Potter y el prisionero de Azkaban','Harry está deseando que termine el verano para comenzar un nuevo curso en Hogwarts, y abandonar lo antes posible la casa de sus despreciables tíos, los Dursley. Lo que desconoce Harry es que va a tener que abandonar Privet Drive antes de tiempo e inesperadamente después de convertir a su tía Marge en un globo gigante. Un autobús noctámbulo, y encantado por supuesto, le llevará a la taberna El Caldero Chorreante, donde le espera nada menos que Cornelius Fudge, el Ministro de Magia.','/ve4TEHHmJdnEKVWSYlRa3DdoeKz.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(835739,'Supermonstruos: Érase una vez un cuento','Desde Ricitos de Oro hasta Hansel y Gretel, los supermonstruos consiguen darle un toque mágico y musical a los cuentos de hadas clásicos y otras historias populares','/eK6eBzp7m7WZYaJ3iAnjdPDngiP.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(520946,'100% Wolf: Pequeño gran lobo','Freddy Lupin pertenece a una orgullosa familia de hombres lobo. Confiado de que pronto se convertirá en un hombre lobo de los más temidos, Freddy se queda sorprendido cuando descubre que no es todo lo feroz que esperaba.','/7TxeZVg2evMG42p0uSbMJpWNQ8A.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(615677,'Superniños','Cuando unos invasores  alienígenas capturan a los superhéroes de la Tierra, sus hijos tienen que aprender a trabajar en equipo parea rescatarlos... y salvar el planeta.','/y6FYAhaeFMj9Lsk8OdF2NeWQkbd.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(618353,'Batman: Death in the Family','Producida, dirigida y escrita por Brandon Vietti, "Death in the Family" ofrece una nueva perspectiva sobre una historia de sobra conocida por los aficionados del Caballero Oscuro. En ella, el asesinato de Jason Todd provocará que el futuro de Batman, Robin y Joker tomen nuevos derroteros en los que el espectador puede incidir con sus propias decisiones.  Primera propuesta de película interactiva del universo DC.','/kU7ZiyeUwcpTkYj3UcxSqGdZmxY.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(338967,'Zombieland: Mata y remata','En esta secuela y empleando el característico sentido del humor del que hizo gala "Zombieland", el grupo de protagonistas tendrá que viajar desde la Casa Blanca hasta el corazón de los Estados Unidos, sobreviviendo a nuevas clases de muertos vivientes que han evolucionado desde lo sucedido hace algunos años, así como a algunos supervivientes humanos rezagados. Pero, por encima de todo, tendrán que tratar de soportar los inconvenientes de convivir entre ellos.','/e7tMI0zVKJB2TS74TaBifIZIkCp.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(532142,'CRYING FREE SEX','','/8OnpWmejEaJIDbsvqH2I1jxsxLV.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(825597,'Maggie Simpson en El Despertar De La Siesta','En una guardería muy, muy lejana ... pero aún en Springfield, Maggie está en una búsqueda épica de su chupete robado. Su aventura la pone cara a cara con jóvenes padawans, señores Sith, droides familiares, escoria rebelde y una batalla definitiva contra el lado oscuro, en este cortometraje original que celebra la galaxia de Star Wars.','/ldZ37wdvIxIGOadZAJZhWNp4AdF.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(544401,'Cherry','Cuenta la historia real de Nico Walker, que volvió de la guerra de Iraq con un trastorno de estrés postraumático no diagnosticado que le llevó primero a hacerse adicto al opio y posteriormente a robar bancos.','/uQtqiAu2bBlokqjlURVLEha6zoi.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(346910,'Predator','Cuando el pequeño Rory (Jacob Tremblay) activa accidentalmente el regreso a la Tierra de los yautjas, desencadenará la vuelta de los cazadores más letales del universo, una especie extraterrestre caracterizada por convertir en su trofeo al resto de criaturas y por obtener su poder a través de la hibridación. Ahora, estos alienígenas han mejorado su ADN y ahora son aún más peligrosos, fuertes, inteligentes y mortales. Por eso, solo un grupo de exsoldados y una profesora de ciencias podrán evitar el fin de la humanidad.','/f4E0ocYeToEuXvczZv6QArrMDJ.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(12445,'Harry Potter y las Reliquias de la Muerte - Parte 2','La segunda parte de la batalla final entre las fuerzas del bien y el mal. El juego nunca ha sido tan peligroso y nadie está a salvo. Se acerca el momento de la confrontación final entre Harry Potter y Lord Voldemort. Todo termina aquí…','/kkUQ8zpBKe0L7ZkgsojWC85pYpi.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(484718,'El rey de Zamunda','¡Akeem y Senmi han vuelto! Desde el exuberante reino de Zamunda, el recién coronado rey Akeem (Eddie Murphy) y su leal confidente Semmi (Arsenio Hall) emprenden una nueva y divertidísima aventura que les hará atravesar el mundo, desde su gran país en África hasta el barrio de Queens, en Nueva York, donde todo empezó.','/vKzbIoHhk1z9DWYi8kyFe9Gg0HF.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(181812,'Star Wars: El ascenso de Skywalker','La Resistencia sobreviviente se enfrenta a la Primera Orden una vez más mientras continúa el viaje de Rey, Finn y Poe Dameron. Con el poder y el conocimiento de las generaciones detrás de ellos, comienza la batalla final.','/jn52me8AagfNt7r84SgQbV0R9ZG.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(578189,'Black and Blue','Una policía novata de Nueva Orleans graba a sus compañeros asesinando a un narcotraficante con la cámara que lleva acoplada al cuerpo. A partir de ese momento, la joven está en el punto de mira de los agentes corruptos y de los camaradas del criminal asesinado.','/7GWDrjxeBsh5onaYf5XHjIM9BA1.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(340102,'Los nuevos mutantes','Cinco jóvenes mutantes que acaban de descubrir sus habilidades, son encerrados en unas instalaciones secretas contra su voluntad y luchan por escapar de su pasado y salvarse a sí mismos.','/lrNbt21hRirjyTK0SeLA0L4RAVS.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(585216,'Escape Room 2: Mueres por salir','Seis personas se encuentran encerradas de manera inesperada en una nueva serie de escape rooms, revelando paulatinamente aquello que tienen en común para sobrevivir… y descubriendo que todos ya habían jugado el juego con anterioridad.','/dsdbViTNjLu4DbgkkYmuY4xDQ20.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(509635,'Alone (Sola)','Una mujer viuda que viaja sola es secuestrada por un asesino a sangre fría. Cuando logra escapar de su captor no tendrá solo que evitar que éste la descubra, sino también que luchar contra los elementos de la naturaleza.','/obExOU9qDnMcxvWPumoD14oxup5.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(786300,'Tentacles','Tara (Dana Drori) y Sam (Casey Deidrick) son una pareja locamente enamorada que comparte absolutamente todo en sus vidas, algo que cambiará para siempre su intimidad... de una forma terrorífica.','/iID0at69rWzZOIarUIFrfDOFJA.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(373571,'Godzilla: Rey de los Monstruos','Los criptozoólogos de la agencia Monarch se enfrentan a un grupo de enormes monstruos: Godzilla, Mothra, Rodan y el enemigo de la humanidad, King Ghidorah. Estas ancianas criaturas harán todo lo posible por sobrevivir, poniendo en riesgo la existencia del ser humano en el planeta.','/30BxobPLvzTp3ziDDPDnKLQUzi8.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(797394,'Agencia Secreta de Control Mágico','La Agencia del Control de Magia envía a sus dos mejores agentes, Hansel y Gretel, a luchar contra la bruja de la Casa del Pan de Jengibre.','/tzJZaglq1hR7RS35BKG68Xz7KY0.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(531499,'The Tax Collector','David Cuevas es un hombre de familia que trabaja como recaudador de impuestos de los pandilleros de alto rango de Los Ángeles. Hace colecciones en toda la ciudad con su compañero Creeper asegurándose de que las personas paguen o vean represalias. Una vieja amenaza regresa a Los Ángeles que pone en peligro todo lo que David ama.','/zogWnCSztU8xvabaepQnAwsOtOt.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(631132,'Goblin Slayer: Goblin´s Crown','En un mundo dominado por los monstruos, una joven sacerdotisa se somete a un entrenamiento para combatirlos. Adiestrada, se une a un grupo de guerreros sin experiencia que se dispone a derrotar a los seres malignos.','/ySHlkHDbXztjdjRJ0pZN7FXRnaW.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(862,'Toy Story','Los juguetes de Andy, un niño de seis años, temen que haya llegado su hora y que un nuevo regalo de cumpleaños les sustituya en el corazón de su dueño. Woody, un vaquero que ha sido hasta ahora el juguete favorito de Andy, trata de tranquilizarlos hasta que aparece Buzz Lightyear, un héroe espacial dotado de todo tipo de avances tecnológicos. Woody es relegado a un segundo plano., pero su constante rivalidad se transformará en una gran amistad cuando ambos se pierden en la ciudad sin saber cómo volver a casa.','/3Rfvhy1Nl6sSGJwyjb0QiZzZYlB.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(330457,'Frozen 2','¿Por qué nació Elsa con poderes mágicos? La respuesta le está llamando y amenaza su reino. Junto con Anna, Kristoff, Olaf y Sven emprenderá un viaje peligroso e inolvidable. En ´Frozen: El Reino del Hielo´, Elsa temía que sus poderes fueran demasiado para el mundo. En ´Frozen 2´, deseará que sean suficientes.','/xJWPZIYOEFIjZpBL7SVBGnzRYXp.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(316727,'Election: La noche de las bestias','Han pasado dos años desde que el ex-sargento de policía Leo Barnes (Frank Grillo) decidió no vengarse del hombre que mató a su hijo. Ahora Barnes dirige al equipo de seguridad que se encarga de proteger a la senadora Charlie Roan (Elizabeth Mitchell), una candidata a la Presidencia que reivindica la supresión de La Purga anual, que consiste en permitir, una noche al año, cualquier actividad criminal, incluído el asesinato. Roan considera que esta práctica perjudica sobre todo a los necesitados y a los pobres.','/qq9Whyz2tmIh5MjGN5or1S6Q9MZ.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(315635,'Spider-Man: Homecoming','Peter Parker comienza a experimentar su recién descubierta identidad como el superhéroe Spider-Man. Después de la experiencia vivida con los Vengadores, Peter regresa a casa, donde vive con su tía. Bajo la atenta mirada de su mentor Tony Stark, Peter intenta mantener una vida normal como cualquier joven de su edad, pero interrumpe en su rutina diaria el nuevo villano Vulture y, con él, lo más importante de la vida de Peter comenzará a verse amenazado.','/tTlAA0REGPXSZPBfWyTW9ipIv1I.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(372058,'Your name','La “historia de milagros y amor” gira en torno a Mitsuha y Taki. Mitsuha es una estudiante de secundaria que vive en un pueblo rural situado en las montañas. Su padre es el alcalde y no pasa mucho por casa, ella vive con su hermana pequeña estudiante de primaria y su abuela, ni ella ni su padre participan en una campaña electoral. Ella se lamenta de que vive confinada en un pueblo rural y anhela el maravilloso estilo de vida de Tokio. Taki es un estudiante de secundaria que vive en el centro de Tokio. Él pasa su tiempo junto a sus amigos, trabajando a tiempo parcial en un restaurante italiano y está interesado en la arquitectura y las bellas artes. Un día, Mitsuha tiene un sueño en el que ella tiene el cuerpo de un hombre joven. Taki también tiene un sueño parecido y en el que él es una estudiante de secundaria en un pueblo en las montañas en él que nunca ha estado. ¿Cuál es el secreto de sus sueños?','/dIWwZW7dJJtqC6CgWzYkNVKIUm8.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(440249,'Cuando se acaba el porno 2','En esta secuela de After Porn Ends se entrevista a un nuevo grupo de ex-estrellas del porno para ser testigos de cómo son sus vidas después de abandonar la industria del cine para adultos. Entre las entrevistadas, leyendas del género como Ginger Lynn (Ten Little Maidens) o Georgina Spelvin (Devil in Miss Jones).','/uO6ZUez70Twan92pqoV60T9kiGH.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(301528,'Toy Story 4','Woody siempre ha tenido claro cuál es su labor en el mundo y cuál es su prioridad: cuidar a su dueño, ya sea Andy o Bonnie. Sin embargo, Woody descubrirá lo grande que puede ser el mundo para un juguete cuando Forky se convierta en su nuevo compañero de habitación. Los juguetes se embarcarán en una aventura de la que no se olvidarán jamás.','/q62bpQ67qaXY0u6b2wFEnQYIbPd.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(618416,'La familia Bloom','Cuando un aliado poco probable entra en el mundo de la familia Bloom en forma de una cría de urraca herida a la que llaman Penguin, la llegada del pájaro marca una gran diferencia en la vida de la familia en apuros.','/2dWWf6qjVU0TklCUKCUra1Yqfz3.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(324786,'Hasta el último hombre','Narra la historia de Desmond Doss, un joven médico militar que participó en la sangrienta batalla de Okinawa, en el Pacífico durante la II Guerra Mundial, y se convirtió en el primer objetor de conciencia en la historia estadounidense en recibir la Medalla de Honor del Congreso. Doss quería servir a su país, pero desde pequeño se había hecho una promesa a sí mismo: no coger jamás ningún arma.','/yQIBS8B9l2qXoPoPtxSXvH7CfoT.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(8587,'El rey león','La sabana africana es el escenario en el que tienen lugar las aventuras de Simba, un pequeño león que es el heredero del trono. Sin embargo, se ve forzado a exiliarse al ser injustamente acusado de la muerte de su padre. Durante su destierro, hará buenas amistades y, finalmente, regresará para recuperar lo que legítimamente le corresponde.','/wXsQvli6tWqja51pYxXNG1LFIGV.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(489245,'Escuadrón de la muerte','Afganistán, 2009. El recién llegado Andrew Briggman (Nat Wolff) es un soldado  que trata de destacar dentro de un escuadrón repleto de salvajes militares. Inspirado por la determinación del sargento Deeks (Alexander Skarsgård), Briggman trata de imitar su conducta temeraria, y en seguida consigue escalar puestos. Pero cuando Briggman es testigo de como el pelotón comienza a matar civiles inocentes, tendrá muchas dudas morales al respecto. Entonces tendrá que tomar una difícil decisión: denunciarlo poniendo en peligro su vida o callarse para participar en lo que cree que son crímenes contra los derechos humanos. Esta película bélica basada en hechos reales la dirige el dos veces nominado al Oscar Dan Krauss.','/9NWhSoWnQGpkjdWLLHUd9N8dGF2.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(284053,'Thor: Ragnarok','Thor está preso al otro lado del universo sin su poderoso martillo y se enfrenta a una carrera contra el tiempo. Su objetivo es volver a Asgard y parar el Ragnarok porque significaría la destrucción de su planeta natal y el fin de la civilización Asgardiana a manos de una todopoderosa y nueva amenaza, la implacable Hela. Pero, primero deberá sobrevivir a una competición letal de gladiadores que lo enfrentará a su aliado y compañero en los Vengadores, ¡el Increíble Hulk!','/kaIfm5ryEOwYg8mLbq8HkPuM1Fo.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(761270,'Dancing Queens','La historia de Dylan Pettersson, una joven de un pueblecito que sueña con ser bailarina y se disfraza de hombre para actuar en un club de drag queens que está en horas bajas.','/75iMCbiw9IQZC3UT2C4eF83QxHT.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(293660,'Deadpool','Basado en el anti-héroe menos convencional de la Marvel, Deadpool narra el origen de un ex-operativo de la fuerzas especiales llamado Wade Wilson, reconvertido a mercenario, y que tras ser sometido a un cruel experimento adquiere poderes de curación rápida, adoptando Wade entonces el alter ego de Deadpool. Armado con sus nuevas habilidades y un oscuro y retorcido sentido del humor, Deadpool intentará dar caza al hombre que casi destruye su vida.','/en971MEXui9diirXlogOrPKmsEn.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(423204,'Objetivo: Washington D.C.','Después de un ataque traicionero, el agente del Servicio Secreto Mike Banning es acusado de intentar asesinar al Presidente Trumbull. Perseguido por sus propios colegas y por el FBI, Banning comienza una carrera contrarreloj para limpiar su nombre.','/k2WyDw2NTUIWnuEs5gT7wgrCQg6.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(118406,'Road to Ninja: Naruto la Película','La película se basa en una realidad alterna del universo de Naruto, en la que él nunca perdió a sus padres, y Tobi, (el villano enmascarado), lleva a cabo su plan "Ojo de Luna" para gobernar el mundo, sumiéndolo bajo una ilusión. En esta película los personajes como Sasuke Uchiha tiene una personalidad más agradable y gentil, además de que le gusta Sakura Haruno.','/hBIZ6RiaCWszRbdvHAy6RWHyT3c.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(284054,'Pantera Negra','"Black Panther" cuenta la historia de T´Challa quien, después de los acontecimientos de "Capitán América: Civil War", vuelve a casa, a la nación de Wakanda, aislada y muy avanzada tecnológicamente, para ser proclamado Rey. Pero la reaparición de un viejo enemigo pone a prueba el temple de T´Challa como Rey y Black Panther ya que se ve arrastrado a un conflicto que pone en peligro todo el destino de Wakanda y del mundo.','/AlFqBwJnokrp9zWTXOUv7uhkaeq.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(749618,'El camino de Xico','La paz de un pequeño pueblo corre peligro cuando una corporación quiere destruir la montaña que los protege. Una niña llamada Copi y su mejor amigo Xico, un perro Xoloitzcuintle, irán a las montañas para intentar salvar la ciudad.','/fZHvSNUBKSgRAduB5k0fFST1xYn.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(76492,'Hotel Transilvania','Drácula regenta un hotel en el que se alojan personajes como Frankenstein, la Momia, el Hombre Invisible, hombres-lobo... El problema del conde es que tiene una hija de espíritu aventurero a la que le resulta difícil controlar. El conflicto surge cuando se aloja en el hotel un ser humano que se siente atraído por la hija del dueño.','/9N3KKOKpqEFe9GhHaIVHwk9N1Y.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(658558,'Kyochuu Rettou','Después de un accidente de avión durante un viaje escolar, Oribe Mutsumi y sus compañeros de clase quedaron varados en una isla aparentemente desierta. Mutsumi encontró a los otros sobrevivientes, y usó su conocimiento del desierto para ayudarlos. Ella espera que sean rescatados en unos tres días, lo que no parece durar tanto. Sin embargo, no tuvo en cuenta el hecho de que la isla está poblada por gigantescos insectos asesinos. ¡Su conocimiento de mariposas, avispas y más puede ser la única cosa que ayude a cualquiera de sus compañeros a sobrevivir para ser rescatados!','/aiQICxiWNcOsJruYxdPuhb6WtWu.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(122917,'El hobbit: La batalla de los cinco ejércitos','Después de haber recuperado el reino del Dragón Smaug, la Compañía ha desencadenado, sin querer, una potencia maligna. Un Smaug enfurecido vuela hacia la Ciudad del Lago para acabar con cualquier resto de vida. Obsesionado sobre todo con el reino recuperado, Thorin sacrifica la amistad y el honor para mantenerlo mientras que Bilbo intenta frenéticamente hacerle ver la razón por la que el hobbit toma una decisión desesperada y peligrosa. Pero hay aún mayores peligros por delante. Sin la ayuda aparente del mago Gandalf, su gran enemigo Sauron ha enviado legiones de orcos hacia la Montaña Solitaria en un ataque furtivo. Cuando la oscuridad se cierna sobre ellos, las razas de los Enanos, Elfos y Hombres deben decidir si unirse o ser destruidos. Bilbo se encontrará así en la batalla épica de los Cinco Ejércitos, donde el futuro de la Tierra Media está en juego.','/zn13a7U9eMTJq8sHthe3bCgsVm4.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(511987,'Infierno bajo el agua','Cuando un enorme huracán llega a su pueblo en Florida, Haley ignora las órdenes de evacuación para buscar a su padre. Tras encontrarle gravemente herido, ambos quedan atrapados por la inundación. Prácticamente sin tiempo para escapar de la tormenta que arrecia, Haley y su padre descubren que la subida del nivel del agua es el menor de sus problemas.','/lm4xH0YwFbVvTgdtau1thNK5S6J.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(383498,'Deadpool 2','Wade Wilson (Ryan Reynolds), mejor conocido como Deadpool, su nombre de batalla e identidad antiheroica, está de regreso con Deadpool 2 y en esta ocasión su misión será salvar a un chico llamado Russell (Julian Dennison) de las manos de un poderoso rival llamado Cable (Josh Brolin). En aras de dar cumplimiento a su tarea el antihéroe formará un grupo al cual pondrá el nombre de X-Force. Secuela de la exitosa película (recaudó más de 780 millones de dólares en todo el mundo) parodia de los superhéroes mutantes del 2016, también protagonizada por Reynolds.','/3P52oz9HPQWxcwHOwxtyrVV1LKi.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(454626,'Sonic: La película','Sonic, el descarado erizo azul basado en la famosa serie de videojuegos de Sega, vivirá aventuras y desventuras cuando conoce a su amigo humano y policía, Tom Wachowski (James Marsden). Sonic y Tom unirán sus fuerzas para tratar de detener los planes del malvado Dr. Robotnik (Jim Carrey), que intenta atrapar a Sonic con el fin de emplear sus inmensos poderes para dominar el mundo.','/stmYfCUGd8Iy6kAMBr6AmWqx8Bq.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(778552,'Al Lado de Cristo','El ladrón penitente es la historia de los dos hombres sin nombre que fueron crucificados junto a Jesús y cómo llegaron a estar junto a él en la cruz ese fatídico día. El ladrón penitente es una historia épica que comienza con el viaje de los magos y su encuentro casual con el joven Dismas y su hermano Jotham en el pesebre de Belén. Poco después, los jóvenes hermanos sufrirán una tragedia atroz que los llevará a ser acogidos por una banda de ladrones con inclinación por la violencia. Allí, conocen a Gestas, otro joven que compartirá su destino. Juntos, en su viaje a la cruz, intentarán dejar atrás su destino. Pero primero, deben sobrevivir a un despiadado centurión romano que amenaza con desatar una terrible venganza contra ellos. En el camino, con frecuencia se cruzan con Jesús y otras figuras bíblicas influyentes. Pero pronto descubrirán que no hay escapatoria del brutal final que les espera a todos en el Gólgota.','/2q4ec7QNNmLQYxvxjZrB4AZeb2W.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(646207,'Ice Road','Una remota mina de diamantes ha colapsado dejando atrapados a un grupo de mineros en una región lejana y helada de Canadá. Como parte de un equipo contratado para rescatarlos, el experimentado conductor de una quitahielos emprende un rescate imposible, teniendo que luchar contra una carretera helada, contra las aguas que están descongelándose y contra una amenaza que no ve venir.','/5MlvT4DZIdkpb7A9t375HVoiJ1v.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(659067,'La tierra y la sangre','Tras años dirigiendo un próspero aserradero en medio de los bosques de las Ardenas, contratando a ex presidiarios y jóvenes delincuentes, Said recibe la visita inesperada de los miembros de un cártel de drogas que le exigen que guarde dentro de su fábrica una gran cantidad de cocaína.','/mnq5O3MyfHIJvunmE0fRhMrQQ89.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(126889,'Alien: Covenant','Rumbo a un remoto planeta al otro lado de la galaxia, la tripulación de la nave colonial Covenant descubre lo que creen que es un paraíso inexplorado, pero resulta tratarse de un mundo oscuro y hostil cuyo único habitante es un "sintético" llamado David (Michael Fassbender), superviviente de la malograda expedición Prometheus.  Secuela de "Prometheus" (2012), a su vez precuela de "Alien, el octavo pasajero" (1979).','/6jajFcaY2YsfGQstJ5HaqZNVseX.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(12444,'Harry Potter y las Reliquias de la Muerte - Parte 1','Una tarea casi imposible cae sobre los hombros de Harry: deberá encontrar y destruir los horrocruxes restantes para dar fin al reinado de Lord Voldemort. En el episodio final de la saga, el hechicero de 17 años parte junto con sus amigos Hermione Granger y Ron Weasley en un peligroso viaje por Inglaterra para encontrar los objetos que contienen los fragmentos del alma del Señor Tenebroso, los cuales garantizan su longevidad. Pero el camino no será fácil pues el lado oscuro adquiere más poder con cada minuto que pasa y las lealtades serán puestas a prueba. Harry deberá usar todos los conocimientos que gracias a Dumbledore ha adquirido sobre su enemigo para poder encontrar la forma de sobrevivir a esta última aventura.','/AqLcLsGGTzAjm3pCCq0CZCQrp6m.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(581600,'Spenser: confidencial','Spenser, un expatrullero de Boston que acaba de salir de prisión, y Hawk, un aspirante a luchador, se alian para descubrir la verdad detrás de la muerte de dos agentes de policía.','/ftODZXaXpWtV5XFD8gS9n9KwLDr.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(24428,'Los Vengadores','Cuando un enemigo inesperado surge como una gran amenaza para la seguridad mundial, Nick Fury, director de la Agencia SHIELD, decide reclutar a un equipo para salvar al mundo de un desastre casi seguro.','/nNmJRkg8wWnRmzQDe2FwKbPIsJV.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(709629,'Guerra de Likes','Una conocida influencer llega a la conclusión de que su exitosa vida es solo una ilusión por lo que trata de modificar la forma de llevarla.','/nq4LRhGrCZ8ucxMaLMPa3uZV6ku.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(617708,'La Llorona','Una historia de horror y fantasía, llena de suspenso, y una metáfora urgente de la historia reciente de Guatemala y sus heridas políticas curadas.','/oj9pEWQq5higRzKWiE8f0d5hBSb.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(359724,'Le Mans ´66','Se centra en un excéntrico y decidido equipo americano de ingenieros y diseñadores liderados por el visionario automovilístico Carroll Shelby y su conductor británico Ken Miles. Henry Ford II y Lee Iacocca les dan la misión de construir desde cero un nuevo automóvil con el fin de derrocar el dominio de Ferrari en el Campeonato del Mundo de Le Mans de 1966.','/n3UanIvmnBlH531pykuzNs4LbH6.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(2062,'Ratatouille','Remy es una simpática rata que sueña con convertirse en un gran chef francés a pesar de la oposición de su familia y del problema evidente que supone ser una rata en una profesión que detesta a los roedores. El destino lleva entonces a Remy a las alcantarillas de París, pero su situación no podría ser mejor, ya que se encuentra justo debajo de un restaurante que se ha hecho famoso gracias a Auguste Gusteau, una estrella de la cuisine. A pesar del peligro que representa ser un visitante poco común (y desde luego nada deseado) en los fogones de un exquisito restaurante francés, la pasión de Remy por la cocina pone patas arriba el mundo culinario parisino en una trepidante y emocionante aventura.','/xgDj56UWyeWQcxQ44f5A3RTWuSs.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(135397,'Jurassic World','Veintidós años después de lo ocurrido en Jurassic Park, la isla Nublar ha sido transformada en un parque temático, Jurassic Wold, con versiones «domesticadas» de algunos de los dinosaurios más conocidos. Cuando todo parece ir a la perfección y ser el negocio del siglo, un nuevo dinosaurio de especie todavía desconocida y que es mucho más inteligente de lo que se pensaba, comienza a causar estragos entre los visitantes del Parque.','/yOCRqvrRrxbs5FYq2pX1KtLJwmR.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(44251,'Dragon Ball Z: El regreso de Broly','Broly regresa clamando venganza. Tras ser derrotado por Goku en una dura batalla en el planeta Neo Vegeta, Broly logra escapar en una cápsula espacial y llega a la Tierra. Allí queda congelado en un lago durante 7 años. Mientras, buscando las bolas de dragón, Videl, Goten y Trunks llegan a un extraño pueblo amenazado por la presencia de un monstruo. Los sollozos de Goten despiertan a Broly y comienza una batalla.','/kbI9M2m45SSwi3t5ztygAlKxUql.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(458897,'Los ángeles de Charlie','Los ángeles de Charlie siempre han proporcionado servicios de seguridad e investigación a clientes privados, y ahora la agencia Townsend se ha expandido internacionalmente con las mujeres más inteligentes, valientes y mejor entrenadas a lo largo y ancho del planeta – varios equipos de ángeles guiados por otros tantos Bosleys llevando a cabo los trabajos más duros por todo el mundo. Cuando un joven ingeniero de sistemas llama la atención sobre una peligrosa tecnología, los ángeles son llamados a la acción, arriesgando sus vidas por protegernos a todos.','/a0xTB1vBxMGt6LGG4N7k1wO9lfL.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(808,'Shrek','Hace mucho, mucho tiempo, en una lejanísima ciénaga vivía un intratable ogro llamado Shrek. Pero de repente, un día, su absoluta soledad se ve interrumpida por una invasión de sorprendentes personajes de cuento. Hay ratoncitos ciegos en su comida, un enorme y malísimo lobo en su cama, tres cerditos sin hogar y otros muchos seres increíbles que han sido deportados de su reino por el malvado Lord Farquaad. Para conseguir salvar su terreno, y de paso a sí mismo, Shrek hace un pacto con Farquaad y emprende viaje para conseguir que la preciosa princesa Fiona sea la novia del Lord. En tan importante misión le acompañan un burro chistoso, dispuesto a hacer cualquier cosa por Shrek. Todo, menos estarse calladito. Rescatar a la princesa de una dragona enamoradiza que suelta fuego al respirar va a resultar una tontería comparado con lo que ocurre cuando el oscuro secreto que la joven guardaba es revelado.','/2l5UHZBcp9cx1PwKLdisJ0gV9jB.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(632632,'Given -Movie','Después de la emisión del episodio final de la adaptación de anime de Given, la cuenta oficial de Twitter anunció que se lanzará una adaptación de largometraje en 2020, retomando directamente donde se detuvo la serie de televisión.  La historia se centra en Ritsuka, un guitarrista que ha perdido el interés por tocar. Un día, conoce a Mafuyu, que tiene una guitarra rota, y Ritsuka de mala gana comienza a enseñarle a Mafuyu a tocar la guitarra, pero cuando escucha la voz de Mafuyu, las cosas comienzan a cambiar de repente para Ritsuka.','/u1wHUA0R48FH4WV3sGqjwx3aNZm.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(158015,'The Purge: La noche de las bestias','Año 2022. En una futura sociedad distópica, el régimen político vigente, llamado Nueva Fundación de los padres de América, ha decidido como medida catárquica implantar la "purga anual", una regla por la que una noche de cada año se puede cometer cualquier crimen, incluyendo asesinatos y violaciones, sin tener que hacer frente a las  consecuencias ni responder ante la justicia. Así, cuando las viciadas nuevas reglas del mundo exterior amenacen su casa, los miembros de una familia verán su vida en peligro, en el transcurso de una terrorífica noche durante la cual todos se verán puestos a prueba para ver hasta dónde son capaces de llegar para protegerse.','/siBfSB55FBc7IdvgtApq6NaXNHw.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(336843,'El corredor del laberinto: La cura mortal','En este final de saga, Thomas lidera a su grupo en una última misión. Deberán entrar en la legendaria Last City, un laberinto controlado por WCKD que puede llegar a ser el laberinto más mortífero de todos. Cualquier persona que lo supere obtendrá las respuestas a las preguntas y los protagonistas quieren saber lo que realmente sucede.','/bvbyidkMaBls1LTaIWYY6UmYTaL.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(594718,'Sputnik','URSS, 1983. El cosmonauta héroe soviético Vladimir Veshnyakov trae una criatura alienígena a la tierra ... en su propio cuerpo. En el laboratorio secreto de la ciudad del régimen, la neurofisióloga Tatyana Klimova intenta salvar al astronauta del monstruo, descubriendo que está experimentando un interés más que profesional en su paciente.','/mBbA77FyzhU0Tz9tmbKG8heGmh3.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(677638,'Somos osos: La película','Cuando el amor de Grizz, Panda y Ice Bear por los camiones de comida y los videos virales se fue de las manos, llama la atención del Agente Trout del National Wildlife Control, quien se compromete a restaurar el "orden natural" separándolos para siempre. Alejados de su hogar, los Bears se embarcan en un viaje épico por carretera mientras buscan refugio en Canadá, con su viaje lleno de nuevos amigos, obstáculos peligrosos y grandes fiestas. El arriesgado viaje también obliga a los Bears a enfrentar cómo se conocieron y se convirtieron en hermanos, para evitar que su vínculo familiar se separe.','/pO1SnM5a1fEsYrFaVZW78Wb0zRJ.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(337167,'Cincuenta sombras liberadas','Creyendo que han dejado atrás las sombras del pasado, Christian y Anastasia disfrutan de su relación y de su vida llena de lujos. Pero justo cuando Ana empieza a relajarse, aparecen nuevas amenazas que ponen en riesgo su felicidad.','/9ywA15OAiwjSTvg3cBs9B7kOCBF.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(466550,'Drive','Un conocido ladrón y una piloto de carreras clandestinas se alían para dar un gran golpe con el que engañan a las autoridades, que también oculta turbios secretos.','/21bk7sqIsFfeof4vppwGEw1Ahvw.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(324857,'Spider-Man: Un nuevo universo','En un universo paralelo donde Peter Parker ha muerto, un joven de secundaria llamado Miles Morales es el nuevo Spider-Man. Sin embargo, cuando el líder mafioso Wilson Fisk (a.k.a Kingpin) construye el "Super Colisionador" trae a una versión alternativa de Peter Parker que tratará de enseñarle a Miles como ser un mejor Spider-Man. Pero no será el único Spider Man en entrar a este universo:  4 versiones alternas de Spider-Man aparecerán y buscarán regresar a su universo antes de que toda la realidad se colapse.','/6qVF0gnLnbKCgcMfCpCB8GH7B5I.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(486589,'Zapatos rojos y los siete trolls','Unos enanos hechizados se encuentran a una chica con un poder misterioso: sus zapatos rojos. Deberán emprender una misión junto a ella para volver a ser humanos y salvar el reino.','/nN4Gs3vZAOJ1D6FRtrwbU9VGYwU.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(720026,'Asesinos sadicos','Una familia de carniceros sádicos vive en las profundidades del campo. Desde el final del invierno hasta los días caninos del verano, cualquiera que se cruce en su camino es carne muerta.','/jxYROBerNLUExmqFb2yArglwIHd.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(98566,'Ninja Turtles','Nueva York está en peligro debido a que Shredder y El Clan del Pie, dominan la ciudad y ejercen un férreo control sobre todo, incluyendo policía y políticos. Pero cuatro héroes, Leonardo, Michelangelo, Donatello y Raphael, saldrán de las alcantarillas y con la ayuda de la reportera April y su compañero Vern Fenwick intentarán salvar la ciudad.','/nPRwI7U7GoZstXEHyHVc5LuuSVr.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(348893,'Boyka: Invicto IV','Boyka es un luchador de boxeo que se encuentra en mitad de una importante liga. Durante la competición se produce una muerte lo que hace que empiece a replantearse verdaderamente lo que merece la pena este deporte. Cuando descubre que la mujer del fallecido se encuentra en serios problemas, decide luchar una serie de batallas para poder liberarla de la servidumbre.','/tCsYQTkQx7vknDmTw666K1XxAdx.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(599281,'Miedo a la lluvia','Una adolescente que vive con esquizofrenia comienza a sospechar que su vecino ha secuestrado a un niño. Sus padres tratan desesperadamente de ayudarla a vivir una vida normal, sin exponer sus propios secretos trágicos, y la única persona que la cree es Caleb, un niño del que ni siquiera está segura de que exista.','/vxZaw8C5w4XlYEPtptzKJ7lBIFH.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(14836,'Los mundos de Coraline','Película de animación en la que se nos cuenta la historia de Coraline, una jovencita que descubre en su nueva casa una puerta secreta y decide abrirla. Al hacerlo, descubre una segunda versión de su vida, una vida paralela a la que ella tiene. A primera vista, la realidad paralela es curiosamente parecida a su vida de verdad, aunque mucho mejor. Pero cuando su increíble y maravillosa aventura empieza a tomar un cariz peligroso y su otra madre intenta mantenerla a su lado para siempre, Coraline deberá recurrir a su determinación y coraje, a la ayuda de los vecinos y a un gato negro con el don del habla para salvar a sus auténticos padres, a unos niños fantasmas y regresar a casa.','/rRpAZOPY3XxMJY65AJ396IWyjU4.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(666624,'Seguridad','Cuando una adolescente local es acosada sexualmente y golpeada, se levanta revuelo en el pueblo y salen a la luz la corrupción y los prejuicios.','/syuRL8LkPz4HguGAxAwvUt3HWlK.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(857910,'Lokillo: nada es igual','Mediante canciones y bromas, el comediante Lokillo Florez analiza con humor cómo los latinoamericanos se han adaptado a un mundo donde abrazar no está permitido.','/bNiuvw5cZBAUZ7OtH7ZtHycWJlT.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(857873,'Romeo Santos: Utopia Live from MetLife Stadium','En este Concierto se centra en la estrella y más importante defensor de la bachata, el cantautor dominicano Romeo Santos, y su concierto del 21 de septiembre de 2019 en el MetLife Stadium de East Rutherford, Nueva Jersey, que batió récord de asistencia. Romeo aprovechó este evento para reunir, por primera vez en vivo, a todos los bachateros legendarios con los que colaboró en su aclamado disco Utopía (2019), para el deleite del público que cantó sus éxitos favoritos.','/djM5dyoFdbGSAgbRj5jxgxkGvJg.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(779202,'Terapia del Miedo','Después de participar en una sesión de hipnosis, Clara (Cléo Pires) entra gradualmente en un estado catatónico que parece incurable con los métodos tradicionales. Ante esto, su hermana gemela, Fernanda (Cléo Pires) descubre una terapia que acaba haciendo que Clara entre en un universo sobrenatural que saca a la luz una trágica y oscura historia del pasado. Tu única posibilidad de volver a la realidad es con la ayuda de Fernanda, quien tendrá que afrontar sus miedos e ir más allá de los límites de la vida.','/fKQt8d5eY8Aa1kr0PdALAdkPhBK.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(34433,'Dragon Ball Z: Estalla el duelo','Un desconocido saiyan, Paragus, llega a la Tierra en busca de Vegeta para pedirle que gobierne el nuevo mundo de los saiyan y así reestablecer el antiguo poder de su raza. Trunks, Goku, Piccolo y Gohan acompañan a Vegeta al planeta de los saiyans. Pero el objetivo real de Paragus es que Broly, el súper saiyan legendario, extermine a los últimos saiyans que quedaban en la Tierra.','/eN1TMy5hT72G2v92x5cNM5trdFv.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(75624,'Naruto Shippuden 5: Prisión de Sangre','Después de ser capturado por el intento de asesinar al líder de Kumogakure, el Raikage, y el asesinato de varios Jonin de Kirigakure e Iwagakure, Naruto es encarcelado en una instalación de contención penal también conocida como la prisión de la sangre. El capitán del castillo, Mui, usa el jutsu de prisión máxima para robar el poder de los prisioneros. La batalla para demostrar su inocencia y descubrir la verdad ha comenzado para Naruto y sus amigos.','/Abv3ZtGV2NXxPimArb3LDLg2bDH.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(568160,'El tiempo contigo','En la actualidad, Tokio está experimentando lluvias que parecen interrumpir el ritmo habitual de todos los que viven allí sin fin. En medio de este aguacero aparentemente eterno llega la fugitiva estudiante de secundaria Hodaka Morishima, que lucha por mantenerse económicamente, terminando con un trabajo en una editorial de poca monta. Al mismo tiempo, la huérfana Hina Amano también se esfuerza por encontrar trabajo para mantenerse a sí misma y a su hermano menor.  Ambos destinos se entrelazan cuando Hodaka intenta rescatar a Hina de hombres sombríos, decidiendo huir juntos. Posteriormente, Hodaka descubre que Hina tiene un poder extraño pero sorprendente: la capacidad de llamar al sol cada vez que reza por él. Con el clima inusual de Tokio en mente, Hodaka ve el potencial de esta habilidad. Sugiere que Hina debería convertirse en una "chica del sol", alguien que despeje el cielo para las personas cuando más lo necesiten.','/ize3ZieqSy0TCWljmVoEiy8fSFS.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(818659,'Carnaval','Después de una ruptura, una influencer lleva a sus amigas a un viaje gratis al vibrante Carnaval de Bahía, donde descubre que la vida no se trata solo de me gusta en las redes sociales.','/pY6ut8zUtLe66YkegpLegptES79.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(575088,'Baba Yaga: El regreso del demonio','La joven familia que se mudó a un nuevo apartamento en las afueras de la ciudad. La niñera contratada por ellos para la hija recién nacida rápidamente ganó confianza. Sin embargo, el niño mayor, Egor, habla del comportamiento aterrador de una mujer, pero sus padres no le creen. Las cámaras de vigilancia instaladas por el padre para mayor comodidad solo confirman que todo está en orden. Entonces, un día, Egor, al regresar a casa, no encuentra rastro ni de la niñera ni de la hermana pequeña, y los padres están en un trance extraño y ni siquiera recuerdan que tuvieron una hija. Entonces Egor, junto con sus amigos, va en busca, durante la cual resulta que la niñera es un antiguo demonio eslavo, conocido popularmente como Baba Yaga.','/4br4B8C0SRIYcKHUgoaOlGo50MU.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(700995,'Devoto, la invasión silenciosa','Cinco desconocidos despiertan encerrados en un extraño edificio. No saben quién los trajo aquí ni con qué fin. A lo largo de una noche irán descubriendo con sorpresa que afuera está ocurriendo una invasión y que al parecer ellos fueron elegidos para intentar detenerla.','/nWlhFPdaWXWkhZrnELgboEqV0dp.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(743904,'Curious George: Go West, Go Wild','Mientras cuida la granja, George deja escapar accidentalmente a los animales de la granja. Ted, George y el aspirante a vaquero Emmett deben reunirlos, tener en cuenta cada animal y, para empezar, emerger con algunas habilidades nuevas.','/mzMCO3dArUcg1OTmjxi8oZ0FQvK.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(560964,'Junglee','Junglee es una película de aventuras familiares, la historia gira en torno al personaje de Vidyut Jammwal, un veterinario que en su regreso a la reserva de elefantes de su padre, se encuentra y lucha contra una red de cazadores furtivos internacionales.','/64GBB3Qp1sG9AJZediJKEjUkUwI.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(72190,'Guerra Mundial Z','Cuando el mundo comienza a ser invadido por una legión de muertos vivientes, Gerry Lane, un experto investigador de las Naciones Unidas, intentará evitar el fin de la civilización en una carrera contra el tiempo y el destino. La destrucción a la que se ve sometida la raza humana lo lleva a recorrer el mundo entero buscando la solución para frenar esa horrible epidemia.','/upsk7nfUjf8ZSYuokwa5U5YXERm.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(454640,'Angry Birds 2: La Película','Vuelven a la carga Red, el pájaro de color rojo con problemas de mal genio, y sus amigos Chuck, el pájaro amarillo hiperactivo, y Bomb, el pájaro negro muy volátil. En esta segunda parte, los pájaros protagonistas y los intrigantes cerdos de color verde llevarán su conflicto a un nuevo nivel. Y es que, aparecerá una nueva y malvada villana: Zeta, un pájaro que vive en una isla helada. Cuando Zeta lance una bola de hielo sobre la isla en la que se encuentran Red y compañía, nuestros protagonistas tendrán que hacer frente a esta nueva amenaza.','/k7sE3loFwuU2mqf7FbZBeE3rjBa.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(399579,'Alita: Ángel de combate','Ido, un compasivo médico de cíborgs, encuentra a Alita abandonada en el desguace de Iron City. Cuando Alita despierta, no sabe quién es, ni reconoce el mundo en el que se encuentra, todo es nuevo para ella. Ido intentará proteger a Alita de su misterioso pasado, mientras que su nuevo amigo Hugo le ayudará a despertar sus recuerdos. En ese momento, Alita descubre que posee habilidades de combate extraordinarias, que podría usar para salvar a su nueva familia y amigos. Decidida a encontrar la verdad tras sus orígenes, Alita comienza un viaje que le enfrentará a las injusticias de un mundo oscuro y corrupto, descubriendo que sólo ella puede cambiarlo.','/8RKBHHRqOMOLh5qW3sS6TSFTd8h.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(1726,'Iron Man','El multimillonario fabricante de armas Tony Stark debe enfrentarse a su turbio pasado después de sufrir un accidente con una de sus armas. Equipado con una armadura de última generación tecnológica, se convierte en ´El hombre de hierro´ para combatir el mal a escala global.','/vbY95t58MDArtyUXUIb8Fx1dCry.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(553301,'Your Name','Adaptación live-action de la la película de anime Your Name. En esta versión reimaginada, una joven nativa americana que vive en un área rural y un hombre joven de Chicago descubren que mágica e intermitentemente cambian de cuerpo. Cuando el desastre amenaza con terminar con sus vidas, deberán encontrar la forma de encontrarse y salvar sus mundos.','');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(737568,'The Doorman','Un ex marine convertido en portero en un lujoso rascacielos de la ciudad de Nueva York debe ser más astuto y luchar contra un grupo de ladrones de arte y su despiadado líder, mientras lucha por proteger a la familia de su hermana. A medida que los ladrones se vuelven cada vez más desesperados y violentos, el portero recurre a sus habilidades de lucha letales para poner fin al enfrentamiento.','/9pHxv7TX0jOKNgnGMDP6RJ2m1GL.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(296096,'Antes de ti','Louisa “Lou” Clark (Emilia Clarke), una chica inestable y creativa, reside en un pequeño pueblo de la campiña inglesa. Vive sin rumbo y va de un trabajo a otro para ayudar a su familia a llegar a fin de mes. Sin embargo, un nuevo trabajo pondrá a prueba su habitual alegría. En el castillo local, se ocupa de cuidar y acompañar a Will Traynor (Sam Claflin), un joven y rico banquero que se quedó paralítico tras un accidente.','/7jjwdoIVPJp7gcDo9uE1sVZi2Rs.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(425,'Ice Age: La edad de hielo','Hace muchos, muchos años, tantos como 20.000, una pequeña ardirata de nombre Scrat quería esconder una bellota en el hielo. Pero lo que hace es provocar una semicatástrofe que provoca que todos los animales migren hacia el sur, hacia tierras más cálidas. Bueno, lo que se dice todos, todos, no. Porque hay uno que lleva la contraria: se trata del mamut Manfred, un auténtico lobo solitario vagabundo y soberbio que va hacia el norte sólo porque los demás están yendo hacia el sur.','/mCVQ2cZmGkAHG2Q3fDZTQA1YzeI.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(216015,'Cincuenta sombras de Grey','Cuando la estudiante de Literatura Anastasia Steele recibe el encargo de entrevistar al exitoso y joven empresario Christian Grey, queda impresionada al encontrarse ante un hombre atractivo, seductor y también muy intimidante. La inexperta e inocente Ana intenta olvidarle, pero pronto comprende cuánto le desea. Cuando la pareja por fin inicia una apasionada relación, Ana se sorprende por las peculiares prácticas eróticas de Grey, al tiempo que descubre los límites de sus propios y más oscuros deseos.','/7IGKrY1f1KfwMipx9wZC4NRgIdF.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(398818,'Call Me by Your Name','Elio Perlman (Timothée Chalamet), un joven de 17 años, pasa el cálido y soleado verano de 1983 en la casa de campo de sus padres en el norte de Italia. Se pasa el tiempo holgazaneando, escuchando música, leyendo libros y nadando hasta que un día el nuevo ayudante americano de su padre llega a la gran villa. Oliver (Armie Hammer) es encantador y, como Elio, tiene raíces judías; también es joven, seguro de sí mismo y atractivo. Al principio Elio se muestra algo frío y distante hacia el joven, pero pronto ambos empiezan a salir juntos de excursión y, conforme el verano avanza, la atracción mutua de la pareja se hace más intensa.','/hrMbAi9fPTmc6EtpyyAgDKznptu.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(343668,'Kingsman: El círculo de oro','Cuando se produce un ataque contra el cuartel general de Kingsman y un nuevo villano se levanta, Eggsy y Merlin se ven obligados a trabajar junto con la agencia americana conocida como el Statesman para salvar al mundo.','/eVHVwP71el20fofkCHo78ebQv7Q.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(655431,'PSYCHO-PASS サイコパス 3 FIRST INSPECTOR','','/cFVgXPmF8UMGH67roYd4e3QaAHP.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(652004,'El lobo de Snow Hollow','El terror se adueña de un pequeño pueblo al pie de las montañas cuando una serie de cadáveres son descubiertos tras la luna llena. Tras perder a su hija adolescente, incapaz de dormir y al cuidado de su padre enfermo, el oficial Marshall lucha para recordar cada día que no existe tal cosa como eso que llaman "hombres-lobo".','/gbdiI8tzptuOcGp4anJeZAiUzA1.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(375794,'No manches Frida','Es la historia de Zequi, un ladrón de bancos recientemente publicado que va a recuperar el dinero robado enterrado por su cómplice boba antes de ir a la cárcel. Vuelven al sitio sólo para encontrar que Frida Kahlo alta ha construido un gimnasio con el botín. Para conseguir el dinero, se hacen pasar por un maestro sustituto para una escuela que no puede estar al nivel de los maestros de todo. Zequi entra dispuesto a dar la ley pero rápidamente se da cuenta de que la vida en el interior puede haber sido más fácil de manejar que una escuela llena de adolescentes salvajes y rebeldes.','/dFVr0z7PIGwQk5M2kYWykIYFFel.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(621870,'El club secreto de los no herederos al trono','Conocemos a Sam, una princesa nacida en segundo lugar. No es la típica princesa y no encaja en ese mundo. Cuando su madre, la reina, la envía a clases de verano en un internado, Sam averigua que es una tapadera: ella y los demás alumnos descubren que tienen superpoderes y que están ahí para entrenar y entrar a formar parte del club secreto de los no herederos al trono. ¿Serán capaces de aprender a usar sus poderes para salvar sus reinos?','/oSSEcPDfwgZSv2i01Oqxdb9t8fI.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(480042,'Plan de escape 3','El experto en seguridad Ray Breslin (Stallone) es contratado para rescatar a la hija de un magnate de la tecnología de Hong Kong que ha sido secuestrada y puesta bajo custodia en una prisión de Letonia. Por si esto fuera poco, su novia (Jamie King) también es capturada. Ahora, él y su equipo (Dave Bautista & Curtis ´50 Cent´ Jackson) deberán realizar una misión de rescate que les llevará a enfrentarse a su peor enemigo mientras tratan de poner a salvo a los rehenes.','/ygWKYTu7OnZKF9H5NsgjL9iURGV.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(335797,'¡Canta!','Buster es un koala que posee y dirige un gran teatro que está pasando por un momento muy delicado. Para arreglar la situación y recuperar la gloria perdida, organizará el concurso de canto más grande del mundo, que atrae a multitud de animales que buscan convertirse en estrellas. Entre ellos encontramos a un bromista y arrogante ratón, una elefanta adolescente que tiene pánico escénico, una cerda que padece estrés debido a su camada de 25 lechones, un joven gorila proveniente de una familia de gánsteres y una puercoespín que tiene su propia banda de rock alternativo.','/z9ft5HYHzWcasR6SGcgeluxTznB.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(177572,'Big Hero 6','En la metrópolis de San Fransokyo (cruce de San Francisco y Tokio), vive Hiro Hamada, quien aprende a sacar provecho de su capacidad gracias a su brillante hermano Tadashi y sus también brillantes amigos: la buscadora de adrenalina GoGo Tamago, el meticuloso de la limpieza Wasabi-No-Ginger, la genia de la química Honey Lemon y el fanático de los cómics Fred. Cuando tras un devastador giro de los acontecimientos, se ven envueltos en una peligrosa conspiración que tiene lugar en las calles de San Fransokyo, Hiro recurre a su amigo más íntimo: un robot llamado Baymax, y transforma al grupo en una banda de héroes de última tecnología decididos a resolver el misterio.','/4s2d3xdyqotiVNHTlTlJjrr3q0H.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(487242,'Escuadrón Suicida: Consecuencias infernales','Amanda Waller forma el Escuadrón Suicida con Deadshot, Harley Quinn, Tigre de Bronce, Capitán Boomerang, Killer Frost y Copperhead, y los envía a recuperar un potencial objeto místico que está en la mira de otros villanos.','/w7c5L2yOVR7hhnTr69SpSxMpj3v.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(619278,'Inside Man: Most Wanted','Un negociador de rehenes de la policía de Nueva York se une a un agente federal para rescatar a docenas de turistas retenidos como rehenes durante un asedio de 10 horas en la Reserva Federal de los Estados Unidos.','/5vyL5X9f1BMtUIFDSvrfKKvMtGG.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(505225,'Su último deseo','En el punto de inflexión del asunto Irán-Contra, Elena McMahon, una intrépida periodista de investigación que cubre la campaña presidencial estadounidense de 1984, se pone en peligro cuando abandona la tarea que se le ha asignado para cumplir el último deseo de su padre enfermo, un hombre misterioso cuyas actividades pasadas ella apenas conoce.','/cGUxPXVZF5n5P09dnlhWC8bLVp7.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(715658,'The Scientist','Steve Unger busca desesperadamente la cura para salvar a su esposa que padece una enfermedad terminal, además debe cuidar a su pequeña hija de 10 años Lily, lo que complica más aún su situación. Por eso, decide dejar de lado su ética y moral, experimentando con la modificación del ADN, la última esperanza para salvar a su esposa, o quizás para conocer el horror que nunca imaginó.','/ovwN1JDPvllWZaH3xtKp7txRWDj.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(428045,'El misterio del dragón','El cartógrafo inglés Jonathan Green recibe la orden de crear un mapa de la lejana Rusia. En su largo viaje, Jonathan vivirá todo tipo de aventuras, desde enfrentamientos con extrañas criaturas y batallas con maestros en artes marciales hasta brujas milenarias ocultas en los rincones más recónditos de la legendaria China. Pero todas las pruebas parecerán un juego de niños cuando tenga que enfrentarse al mayor de los enemigos jamás creado por la magia negra: el gran Rey de los Dragones.','/7m8zy0eJ0d0JmEyOkC2fSx1KbYU.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(662546,'Amadrinadas','Un hada madrina joven y poco calificada que se aventura por su cuenta para demostrar su valía rastreando a una joven cuya solicitud de ayuda fue ignorada. Lo que descubre es que la niña ahora se ha convertido en una mujer adulta que necesita algo muy diferente a un "príncipe azul".','/uztSaahK3bNVE5iZh4mRjHcCeii.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(574982,'The Blackout','Ningún meteorito golpeó la Tierra, ningún terrorista puso al mundo en peligro ni se inició una guerra atómica, pero algo salió mal. El contacto entre la mayoría de las partes de la Tierra es interrumpido. Una pequeña área similar a un anillo en Europa del Este todavía tiene electricidad, y tal vez incluso haya vida. Cuando las fuerzas militares llegan, encuentran cadáveres en tiendas, automóviles, carreteras, hospitales y estaciones de ferrocarril. ¿Quién o qué está destruyendo toda la vida en la Tierra?','/4phMeITqEnShF5C3ZD0Q8YQFMAB.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(863,'Toy Story 2','Cuando Andy se va de campamento dejando solos a los juguetes, Al McWhiggin, un compulsivo coleccionista de juguetes valiosos, secuestra a Woody. Buzz Lightyear y el resto de los juguetes de Andy deberán actuar con rapidez para rescatarlo, poniéndose al frente de una operación de rescate durante la cual se enfrentarán a múltiples peligros y divertidas situaciones.','/l4B2QI2lRKzHMJHke9FAsXLHP35.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(732472,'The Amityville Harvest','Mientras se hospeda en una vieja mansión para investigar su historia de contrabando de licores, Christina y su equipo de video documental entrevistan a Vincent, su espeluznante anfitrión, solo para darse cuenta que su imagen o su voz no queda grabado en sus equipos de vídeo.','/jW44Mb6zCPzjoMc29bbAC7vUIm8.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(168259,'Fast & Furious 7','De nuevo los problemas les persiguen. Sin conseguir librarse de la mancha de criminales de su ficha. Su pasado de larga trayectoria en las carreras ilegales les perseguirá y deberán hacer frente a las circunstancias de la única forma que saben. Cuando les pongan entre la espada y la pared idearán un plan para escapar del peligro en una trepidante carrera por salvar la vida y limpiar su reputación. Acción, persecuciones y un ritmo frenético en esta nueva entrega.','/cHkhb5A4gQRK6zs6Pv7zorHs8Nk.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(518764,'Animal World','Zheng Kaisi debe mucho dinero a sus amigos. Para pagar su deuda decide embarcarse en el "Destiny", un barco en el que hay una misteriosa fiesta de apuestas.','/qsimYNbLnak0QAHK3sopWzyW8H7.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(271110,'Capitán América: Civil War','"Captain America: Civil War” continúa la historia de “Avengers: Age of Ultron”, con Steve Rogers liderando un nuevo equipo de Vengadores en su esfuerzo por proteger a la humanidad. Tras otro incidente internacional relacionado con los Vengadores que ocasiona daños colaterales, la presión política fuerza a crear un sistema de registro y un cuerpo gubernamental para determinar cuándo se requiere los servicios del equipo. El nuevo status quo divide a los Vengadores mientras intentan salvar al mundo de un nuevo y perverso villano.','/kvRT3GwcnqGHzPjXIVrVPhUix7Z.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(338970,'Tomb Raider','Tras la desaparición de su padre, Lara vive una vida imprudente y despreocupada. Cuando la policía la arresta después de provocar un accidente de tráfico,  Ana Miller, la socia de negocios de su progenitor, deposita su fianza y le advierte que si no reclama la herencia de éste,  se liquidarán todos sus bienes.','/bLJTjfbZ1c5zSNiAvGYs1Uc82ir.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(19995,'Avatar','Año 2154. Jake Sully, un ex-marine condenado a vivir en una silla de ruedas, sigue siendo un auténtico guerrero. Por ello ha sido designado para ir a Pandora, donde algunas empresas están extrayendo un mineral extraño que podría resolver la crisis energética de la Tierra. Para contrarrestar la toxicidad de la atmósfera de Pandora, se ha creado el programa Avatar, gracias al cual los seres humanos mantienen sus conciencias unidas a un avatar: un cuerpo biológico controlado de forma remota que puede sobrevivir en el aire letal. Esos cuerpos han sido creados con ADN humano mezclado con ADN de los nativos de Pandora, los Na´vi. Convertido en avatar, Jake puede caminar otra vez. Su misión consiste en infiltrarse entre los Na´vi, que se han convertido en el mayor obstáculo para la extracción del mineral. Pero cuando Neytiri, una bella Na´vi, salva la vida de Jake, todo cambia: Jake, tras superar ciertas pruebas, es admitido en su clan.','/AmHOQ7rpHwiaUMRjKXztnauSJb7.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(698009,'어린 처제 3','','/h1BoDAepuEmEMC2qhjBONAYhre7.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(378064,'Una voz silenciosa','La historia gira en torno a Shouko, una chica sorda que, al llegar a su nuevo colegio, es despreciada por sus compañeros y sobretodo por Shouya, un chico que también sufrirá acoso escolar después. Años más tarde, Shouya se siente en la obligación de reencontrarse con Shouko.','/q5HZvtyqG8Vz39Ee9uTQbLeEml.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(12429,'Ponyo en el acantilado','La historia se centra en Sosuke, un niño de 5 años, y su relación con una princesa pez que ansía convertirse en un ser humano. Libre adaptación de "La sirenita" que obtuvo muy buena acogida de la crítica en el Festival de Venecia 2008.','/shqLeIkqPAAXM8iT6wVDiXUYz1p.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(118,'Charlie y la fábrica de chocolate','Charlie Bucket (Freddie Highmore), un niño muy bueno de una familia muy pobre, gana un concurso, junto a otros cuatro niños de diferentes partes del mundo, para disfrutar de una visita durante todo un día a la gigantesca fábrica de chocolate dirigida por el excéntrico Willy Wonka (Johnny Depp) y su equipo de Oompa-Loompas. La fábrica se parece a un mundo fantástico y mágico lleno de diferentes sabores, todos muy dulces.','/bSvUW4JQ6g4QiKvwejcfcPRd4Ke.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(592656,'Hermanos de sangre','Peter y Michael, criados en las calles de Filadelfia, son hijos de miembros de la mafia irlandesa, vinculados para siempre por los crímenes de sus padres. 30 años después, Michael ahora dirige la organización criminal y desea más poder, sus peligrosas travesuras frecuentemente controladas por su prudente primo Peter. Perseguido por la muerte de su hermana, cuyo fallecimiento destruyó a sus padres, Peter se ve atrapado entre los sueños de la infancia y las realidades de su vida como ejecutor. Su único indulto es un gimnasio de boxeo local, un santuario que rápidamente se ve amenazado a medida que aumenta el deseo de control de Michael.','/bjfoBpZ5qP71wrUwGCLTZ2tDtw8.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(531299,'Kill Chain','El filme sitúa al bueno de Cage en un hotel que regenta cuando recibe la visita de 2 desconocidos a los cuales esperaba. A partir de ahí, sucederán varias historias encadenadas de desconocidos que, poco a poco, se irán enlazando entre sí para llevarnos al punto inicial, resolviendo el por qué del propio título.','/p6ExERRwodksg0fFKzCjmNCR6Hw.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(2300,'Space Jam','Bugs Bunny y su equipo desafían a los Nerdlucks (un grupo de pequeños extraterrestres) a un partido de baloncesto para decidir si los Looney Tunes permanecen en la Tierra o se trasladan a una lejana galaxia para trabajar en un parque de atracciones de Montaña Tontolandia. Los Nerdlucks cuentan con una poderosa arma secreta que los hace superiores: se han apoderado de las mejores cualidades de las estrellas de la NBA (Charles Barkley y Patrick Ewing). Pero también los Looney poseen un arma secreta: ¡Michael Jordan!','/xIoWDHSA2ymOewcCpoUID4PpDb3.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(560192,'Atrapado en Grand Isle','Walter y su esposa descuidada atraen a un joven a su casa victoriana para escapar de un huracán. Cuando el hombre es acusado de asesinato por el detective Jones, debe revelar los perversos secretos de la pareja para salvarse.','/tXQP5bdZbNWogkQhTHy0H5kqlUy.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(82507,'Sinister','Un periodista viaja con su familia a lo largo y ancho del país para investigar terribles asesinatos que luego convierte en libros. Cuando llega a una casa donde ha tenido lugar el asesinato de una familia, encuentra una cinta que desvela horribles pistas que van más allá del esclarecimiento de la tragedia.','/cSgDucubHzMSoWhUoA2URo6bRlC.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(157336,'Interestelar','Narra las aventuras de un grupo de exploradores que hacen uso de un agujero de gusano recientemente descubierto para superar las limitaciones de los viajes espaciales tripulados y vencer las inmensas distancias que tiene un viaje interestelar.','/rAiYTfKGqDCRIIqo664sY9XZIvQ.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(283995,'Guardianes de la galaxia Vol. 2','Una poderosa raza alienígena contrata a los Guardianes para que protejan sus valiosas baterías de energía, pero, cuando Rocket las roba, los alienígenas envían a sus tropas de combate a vengarse de ellos. Mientras tratan de escapar con vida, intentan resolver el misterio de los verdaderos orígenes de Peter Quill.','/aJn9XeesqsrSLKcHfHP4u5985hn.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(595172,'El progreso del peregrino','Adaptación moderna del clásico de John Bunyan. Christian comienza un viaje desde la Ciudad de la Destrucción hasta la Ciudad Celestial mientras el enemigo supremo intenta todo lo que está en su poder para distraerlo de su destino.','/l2Ao3NXfrXtWzlBZ5DnP2l2szJj.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(500916,'Travesía salvaje','Un cazador que se dedica a capturar animales para luego venderlos a distintos zoológicos compra un pasaje para embarcarse en un crucero repleto de animales exóticos con los que piensa hacerse de oro, entre los que se incluye un jaguar y otros animales del Amazonas. Sin embargo, desconoce que en el mismo barco se está extraditando a un asesino en serie que, tras escapar del control de sus captores, liberta a los animales y con ellos el caos total.','/A3DD0R6vZ5SwD0qGKaU7HL5KVat.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(484641,'Anna','Bajo la hipnotizante belleza de Anna Poliatova yace un secreto que le permite desatar una imparable agilidad y fuerza y convertirse en una de las asesinas más temidas por los gobiernos del mundo.','/c1YQcpqsljC7lYEmTIeftcl22VS.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(584044,'The Viking War','Ingrid y sus hermanos huyen de los Beserkers que han comenzado a invadir las aldeas, asumiendo el control, usando salvajemente a los residentes en un juego donde ellos vs un Beserker, y si ganan, pueden sobrevivir, solo que nadie gana. . Los hermanos intentan escapar de los Beserkers después de que asesinaron violentamente y se apoderaron de su ciudad. Sin embargo, los Beserkers están en su camino y quieren ponerlos en el juego.','/ebaQIQ0Uj60Rb9qcXaz0wF5B77I.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(9023,'Spirit: El corcel indomable','Sigue las aventuras de un corcel mustang salvaje e ingobernable que recorre la indómita frontera norteamericana. Cuando encuentra a un hombre por primera vez, un joven de la tribu de los Lakota llamado Little Creek, Spirit se niega a dejarse domar por él pero sí se hace amigo suyo. El valiente corcel también encuentra el amor con una hermosa yegua llamada Rain. Spirit se conviertirá en uno de los grandes héroes anónimos del Viejo Oeste.','/AglvRe4XNrV8livEMocj7jFkxtT.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(809,'Shrek 2','Cuando Shrek y la princesa Fiona regresan de su luna de miel, los padres de ella los invitan a visitar el reino de Muy Muy Lejano para celebrar la boda. Para Shrek, al que nunca abandona su fiel amigo Asno, esto constituye un gran problema. Los padres de Fiona, por su parte, no esperaban que su yerno tuviera un aspecto semejante y, mucho menos, que su hija hubiera cambiado tanto. Todo esto trastoca los planes del rey respecto al futuro del reino. Pero entonces entran en escena la maquiavélica Hada Madrina, su arrogante hijo el Príncipe Encantador y un minino muy especial: el Gato con Botas, experto cazador de ogros.','/b33E34IywGC4NWYY3G1ck7uehNF.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(644092,'´Ohana: El tesoro de Hawái','Mientras veranean en la isla de Oahu, dos hermanos de Brooklyn descubren un diario con la ubicación de un tesoro. Este hallazgo es el comienzo de una aventura épica, en la que hacen nuevos amigos y conectan con sus raíces hawaianas.','/yImmxRokQ48PD49ughXdpKTAsAU.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(106646,'El lobo de Wall Street','Película basada en hechos reales del corredor de bolsa neoyorquino Jordan Belfort. A mediados de los años 80, Belfort era un joven honrado que perseguía el sueño americano, pero pronto en la agencia de valores aprendió que lo más importante no era hacer ganar a sus clientes, sino ser ambicioso y ganar una buena comisión. Su enorme éxito y fortuna le valió el mote de "El lobo de Wall Street". Dinero. Poder. Mujeres. Drogas. Las tentaciones abundaban y el temor a la ley era irrelevante. Jordan y su manada de lobos consideraban que la discreción era una cualidad anticuada; nunca se conformaban con lo que tenían.','/cWUOv3H7YFwvKeaQhoAQTLLpo9Z.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(834500,'Los Kandasamy: El viaje','Para reavivar sus matrimonios, las mejores amigas y cuñadas Shanthi y Jennifer planean una escapada en pareja. Pero viene con todo tipo de sorpresas.','/gXuTcVYpn4YhYLPm69IxJAdxqtR.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(793002,'Dreamcatcher','Dos hermanas y sus amigos se ven inmersos en una espiral de violencia durante 48 horas tras sufrir una experiencia traumática en un festival de música underground.','/ivwldPk57vcwcCTfQmxOtK5CLvS.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(721656,'¡Scooby!','Con toda clase de monstruos falsos y montones de caramelos por doquier, Halloween es un paraíso para los amantes de la comida. Este año, sin embargo, su fiesta por excelencia se transforma en una pesadilla a causa de un huerto de calabazas que ha sido infectado por un extraño flujo tóxico, generando un ejército imparable de "jack-o-lanterns" que arrasan todo lo que encuentran a su paso. Sólo Scooby-Doo y su grupo de amigos podrán resolver este misterioso caso y salvar Caleta Crystal.','/5gTQmnGYKxDfmUWJ9GUWqrszRxN.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(420818,'El Rey León','Simba es el hijo del rey de los leones, Mufasa, y heredero de todo el reino. Pero cuando su padre es brutalmente asesinado por su tío Scar, decidirá huir, dejando vía libre para que su tío tome el puesto de su padre como líder de la manada. En su camino, Simba se encuentra con el suricato  Timón y el jabalí Pumba, que le enseñarán a vivir la vida sin preocupaciones. Pero el joven león se verá obligado a decidir entre su vida libre de problemas o su destino como rey .','/1TUg5pO1VZ4B0Q1amk3OlXvlpXV.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(99861,'Vengadores: La era de Ultrón','Cuando Tony Stark intenta reactivar un programa caído en desuso cuyo objetivo es mantener la paz, las cosas empiezan a torcerse y los héroes más poderosos de la Tierra, incluyendo a Iron Man, Capitán América, Thor, El Increíble Hulk, Viuda Negra y Ojo de Halcón, tendrán que afrontar la prueba definitiva cuando el destino del planeta se ponga en juego. Cuando el villano Ultron emerge, le corresponderá a Los Vengadores detener sus terribles planes, que junto a incómodas alianzas llevarán a una inesperada acción que allanará el camino para una épica y única aventura.','/xnqust9Li4oxfhXD5kcPi3UC8i4.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(609242,'El robo del siglo','Viernes 13 de enero de 2006. Los francotiradores del Grupo Halcón están a la espera de una orden. Miguel Sileo, el negociador, deja diluir las esperanzas de que Vitette, uno de los líderes de la banda de ladrones que entró a la sucursal del Banco Río de Acassuso de señales de vida. El grupo Halcón recibe la orden y entra: se encuentran con lo inesperado. Armas de juguete y una veintena de rehenes asustados los esperan dentro; no hay señales del grupo de ladrones. Mientras revisan a los rehenes para descubrir a los artífices del robo camuflados entre ellos, la policía va descubriendo que, más de la mitad de las cajas de seguridad fueron abiertas y vaciadas.','/1umKVgbjFG5Cho5ZKTpcvRFJjuJ.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(11674,'101 dálmatas (¡Más vivos que nunca!)','Obsesionada por obtener la auténtica piel de dálmatas para crear su nueva línea de moda, Cruella de Vil no se detiene ante nada. Cuando Anita, una de sus mejores diseñadoras, le cuenta lo contentos que están ella y su marido Roger, porque su pareja de dálmatas, Pongo y Perlita, van a tener cachorros, la mente de Cruella empieza a maquinar para hacerse con los pequeños. (FILMAFFINITY)','/scdEGYcHCf2v9dBheXtIVNu2NqW.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(671583,'Magia del revés','La película se centra en Nory Boxwood Horace (Rose), de 13 años, quien descubre que puede convertirse en animales, y su mejor amiga Reina Carvajal (Agudong), quien puede manipular las llamas, cuando ingresan a la Academia Sage para Estudios Mágicos.','/vam9VHLZl8tqNwkp1zjEAxIOrkk.jpg');
INSERT INTO Movie (Id, Name, Description, Background) VALUES(10144,'La Sirenita','Ariel es una sirena adolescente, hija de Tritón, el rey del mar. Desobedeciendo a su padre, visita la superficie y se enamora del príncipe Eric. Con la esperanza de encontrar a su amado, la sirenita cae inocentemente bajo los encantos de Úrsula, la bruja del mar, que la transforma en un ser humano. Pero la bruja tiene planes terribles para Ariel y su padre.','/o3gOoWXt7y7R9dKNMlEqhU33sRV.jpg');
